INSERT INTO `Pokemon` VALUES (1,'bulbasaur',1,'There is a plant seed on its back right from the\nday this Pokémon is born. The seed slowly\ngrows larger.',NULL,'Seed Pokémon'),(2,'ivysaur',1,'When the bulb on its back grows large, it\nappears to lose the ability to stand on its\nhind legs.',NULL,'Seed Pokémon'),(3,'venusaur',1,'Its plant blooms when it is absorbing solar\nenergy. It stays on the move to seek sunlight.',NULL,'Seed Pokémon'),(4,'charmander',1,'It has a preference for hot things. When it rains,\nsteam is said to spout from the tip of its tail.',NULL,'Lizard Pokémon'),(5,'charmeleon',1,'It has a barbaric nature. In battle, it whips its\nfiery tail around and slashes away with sharp claws.',NULL,'Flame Pokémon'),(6,'charizard',1,'It spits fire that is hot enough to melt boulders.\nIt may cause forest fires by blowing flames.',NULL,'Flame Pokémon'),(7,'squirtle',1,'When it retracts its long neck into its shell, it\nsquirts out water with vigorous force.',NULL,'Tiny Turtle Pokémon'),(8,'wartortle',1,'It is recognized as a symbol of longevity. If its\nshell has algae on it, that Wartortle is very old.',NULL,'Turtle Pokémon'),(9,'blastoise',1,'It crushes its foe under its heavy body to cause\nfainting. In a pinch, it will withdraw inside its shell.',NULL,'Shellfish Pokémon'),(10,'caterpie',1,'For protection, it releases a horrible stench from\nthe antenna on its head to drive away enemies.',NULL,'Worm Pokémon'),(11,'metapod',1,'It is waiting for the moment to evolve. At this\nstage, it can only harden, so it remains\nmotionless to avoid attack.',NULL,'Cocoon Pokémon'),(12,'butterfree',1,'In battle, it flaps its wings at great speed to\nrelease highly toxic dust into the air.',NULL,'Butterfly Pokémon'),(13,'weedle',1,'Its poison stinger is very powerful.\nIts bright-colored body is intended to\nwarn off its enemies.',NULL,'Hairy Bug Pokémon'),(14,'kakuna',1,'While awaiting evolution, it hides from predators\nunder leaves and in nooks of branches.',NULL,'Cocoon Pokémon'),(15,'beedrill',1,'May appear in a swarm. Flies at violent speeds,\nall the while stabbing with the toxic stinger on\nits rear.',NULL,'Poison Bee Pokémon'),(16,'pidgey',1,'It is docile and prefers to avoid conflict.\nIf disturbed, however, it can ferociously strike back.',NULL,'Tiny Bird Pokémon'),(17,'pidgeotto',1,'Very protective of its sprawling territorial area,\nthis Pokémon will fiercely peck at any intruder.',NULL,'Bird Pokémon'),(18,'pidgeot',1,'It spreads its gorgeous wings widely to intimidate\nenemies. It races through the skies at\nMach-2 speed.',NULL,'Bird Pokémon'),(19,'rattata',1,'Its fangs are long and very sharp. They grow\ncontinuously, so it gnaws on hard things to whittle\nthem down.',NULL,'Mouse Pokémon'),(20,'raticate',1,'The webs on its hind legs enable it to cross rivers.\nIt searches wide areas for food.',NULL,'Mouse Pokémon'),(21,'spearow',1,'Eats bugs in grassy areas. It has to flap its short\nwings at high speed to stay airborne.',NULL,'Tiny Bird Pokémon'),(22,'fearow',1,'It has the stamina to fly all day on its broad wings.\nIt fights by using its sharp beak.',NULL,'Beak Pokémon'),(23,'ekans',1,'Moving silently and stealthily, it eats the eggs of\nbirds, such as Pidgey and Spearow, whole.',NULL,'Snake Pokémon'),(24,'arbok',1,'To intimidate foes, it spreads its chest wide and\nmakes eerie sounds by expelling air from its mouth.',NULL,'Cobra Pokémon'),(25,'pikachu',1,'Pikachu that can generate powerful electricity\nhave cheek sacs that are extra soft and\nsuper stretchy.',NULL,'Mouse Pokémon'),(26,'raichu',1,'Its long tail serves as a ground to protect itself\nfrom its own high-voltage power.',NULL,'Mouse Pokémon'),(27,'sandshrew',1,'It loves to bathe in the grit of dry, sandy areas.\nBy sand bathing, the Pokémon rids itself of dirt\nand moisture clinging to its body.',NULL,'Mouse Pokémon'),(28,'sandslash',1,'The drier the area Sandslash lives in, the harder\nand smoother the Pokémon’s spikes will feel\nwhen touched.',NULL,'Mouse Pokémon'),(29,'nidoran-f',1,'Females are more sensitive to smells than males.\nWhile foraging, they’ll use their whiskers to check\nwind direction and stay downwind of predators.',NULL,'Poison Pin Pokémon'),(30,'nidorina',1,'The horn on its head has atrophied. It’s thought\nthat this happens so Nidorina’s children won’t get\npoked while their mother is feeding them.',NULL,'Poison Pin Pokémon'),(31,'nidoqueen',1,'Nidoqueen is better at defense than offense.\nWith scales like armor, this Pokémon will shield\nits children from any kind of attack.',NULL,'Drill Pokémon'),(32,'nidoran-m',1,'The horn on a male Nidoran’s forehead contains\na powerful poison. This is a very cautious\nPokémon, always straining its large ears.',NULL,'Poison Pin Pokémon'),(33,'nidorino',1,'With a horn that’s harder than diamond, this\nPokémon goes around shattering boulders as it\nsearches for a moon stone.',NULL,'Poison Pin Pokémon'),(34,'nidoking',1,'When it goes on a rampage, it’s impossible to\ncontrol. But in the presence of a Nidoqueen it’s\nlived with for a long time, Nidoking calms down.',NULL,'Drill Pokémon'),(35,'clefairy',1,'It is said that happiness will come to those who\nsee a gathering of Clefairy dancing under a\nfull moon.',NULL,'Fairy Pokémon'),(36,'clefable',1,'A timid fairy Pokémon that is rarely seen, it will\nrun and hide the moment it senses people.',NULL,'Fairy Pokémon'),(37,'vulpix',1,'While young, it has six gorgeous tails. When it\ngrows, several new tails are sprouted.',NULL,'Fox Pokémon'),(38,'ninetales',1,'It is said to live 1,000 years, and each of its tails\nis loaded with supernatural powers.',NULL,'Fox Pokémon'),(39,'jigglypuff',1,'Jigglypuff has top-notch lung capacity, even by\ncomparison to other Pokémon. It won’t stop\nsinging its lullabies until its foes fall asleep.',NULL,'Balloon Pokémon'),(40,'wigglytuff',1,'The more air it takes in, the more it inflates. If\nopponents catch it in a bad mood, it will inflate\nitself to an enormous size to intimidate them.',NULL,'Balloon Pokémon'),(41,'zubat',1,'It emits ultrasonic waves from its mouth to check\nits surroundings. Even in tight caves, Zubat flies\naround with skill.',NULL,'Bat Pokémon'),(42,'golbat',1,'It loves to drink other creatures’ blood. It’s said\nthat if it finds others of its kind going hungry,\nit sometimes shares the blood it’s gathered.',NULL,'Bat Pokémon'),(43,'oddish',1,'If exposed to moonlight, it starts to move.\nIt roams far and wide at night to scatter its seeds.',NULL,'Weed Pokémon'),(44,'gloom',1,'Its pistils exude an incredibly foul odor.\nThe horrid stench can cause fainting at a distance\nof 1.25 miles.',NULL,'Weed Pokémon'),(45,'vileplume',1,'It has the world’s largest petals. With every step,\nthe petals shake out heavy clouds of toxic pollen.',NULL,'Flower Pokémon'),(46,'paras',1,'Burrows under the ground to gnaw on tree roots.\nThe mushrooms on its back absorb most of\nthe nutrition.',NULL,'Mushroom Pokémon'),(47,'parasect',1,'The larger the mushroom on its back grows,\nthe stronger the mushroom spores it scatters.',NULL,'Mushroom Pokémon'),(48,'venonat',1,'Lives in the shadows of tall trees where it eats\nbugs. It is attracted by light at night.',NULL,'Insect Pokémon'),(49,'venomoth',1,'The wings are covered with dustlike scales.\nEvery time it flaps its wings, it looses highly\ntoxic dust.',NULL,'Poison Moth Pokémon'),(50,'diglett',1,'If a Diglett digs through a field, it leaves the soil\nperfectly tilled and ideal for planting crops.',NULL,'Mole Pokémon'),(51,'dugtrio',1,'A team of Diglett triplets. It triggers huge\nearthquakes by burrowing 60 miles underground.',NULL,'Mole Pokémon'),(52,'meowth',1,'It loves to collect shiny things. If it’s in a good\nmood, it might even let its Trainer have a look\nat its hoard of treasures.',NULL,'Scratch Cat Pokémon'),(53,'persian',1,'Getting this prideful Pokémon to warm up to you\ntakes a lot of effort, and it will claw at you the\nmoment it gets annoyed.',NULL,'Classy Cat Pokémon'),(54,'psyduck',1,'Psyduck is constantly beset by headaches. If the\nPokémon lets its strange power erupt, apparently\nthe pain subsides for a while.',NULL,'Duck Pokémon'),(55,'golduck',1,'This Pokémon lives in gently flowing rivers. It\npaddles through the water with its long limbs,\nputting its graceful swimming skills on display.',NULL,'Duck Pokémon'),(56,'mankey',1,'It lives in treetop colonies. If one becomes\nenraged, the whole colony rampages for no reason.',NULL,'Pig Monkey Pokémon'),(57,'primeape',1,'It is always outrageously furious. If it gives chase,\nit will tenaciously track the target no matter\nhow far.',NULL,'Pig Monkey Pokémon'),(58,'growlithe',1,'It has a brave and trustworthy nature. It fearlessly\nstands up to bigger and stronger foes.',NULL,'Puppy Pokémon'),(59,'arcanine',1,'The sight of it running over 6,200 miles\nin a single day and night has captivated\nmany people.',NULL,'Legendary Pokémon'),(60,'poliwag',1,'For Poliwag, swimming is easier than walking.\nThe swirl pattern on its belly is actually part of\nthe Pokémon’s innards showing through the skin.',NULL,'Tadpole Pokémon'),(61,'poliwhirl',1,'Staring at the swirl on its belly causes drowsiness.\nThis trait of Poliwhirl’s has been used in place of\nlullabies to get children to go to sleep.',NULL,'Tadpole Pokémon'),(62,'poliwrath',1,'Its body is solid muscle. When swimming through\ncold seas, Poliwrath uses its impressive arms to\nsmash through drift ice and plow forward.',NULL,'Tadpole Pokémon'),(63,'abra',1,'This Pokémon uses its psychic powers while it\nsleeps. The contents of Abra’s dreams affect the\npowers that the Pokémon wields.',NULL,'Psi Pokémon'),(64,'kadabra',1,'Using its psychic power, Kadabra levitates as it\nsleeps. It uses its springy tail as a pillow.',NULL,'Psi Pokémon'),(65,'alakazam',1,'It has an incredibly high level of intelligence.\nSome say that Alakazam remembers everything\nthat ever happens to it, from birth till death.',NULL,'Psi Pokémon'),(66,'machop',1,'Its whole body is composed of muscles.\nEven though it’s the size of a human child, it can\nhurl 100 grown-ups.',NULL,'Superpower Pokémon'),(67,'machoke',1,'Its muscular body is so powerful, it must wear a\npower-save belt to be able to regulate\nits motions.',NULL,'Superpower Pokémon'),(68,'machamp',1,'It quickly swings its four arms to rock its\nopponents with ceaseless punches and chops\nfrom all angles.',NULL,'Superpower Pokémon'),(69,'bellsprout',1,'Its bud looks like a human face. Because of the\nbud, it is rumored to be a type of legendary\nmandrake plant.',NULL,'Flower Pokémon'),(70,'weepinbell',1,'It spits out Poison Powder to immobilize the enemy\nand then finishes it with a spray of Acid.',NULL,'Flycatcher Pokémon'),(71,'victreebel',1,'Once ingested into this Pokémon’s body,\neven the hardest object will melt into nothing.',NULL,'Flycatcher Pokémon'),(72,'tentacool',1,'Tentacool is not a particularly strong swimmer.\nIt drifts across the surface of shallow seas as it\nsearches for prey.',NULL,'Jellyfish Pokémon'),(73,'tentacruel',1,'When the red orbs on Tentacruel’s head glow\nbrightly, watch out. The Pokémon is about to\nfire off a burst of ultrasonic waves.',NULL,'Jellyfish Pokémon'),(74,'geodude',1,'It is impossible to distinguish from rocks. It slams\nagainst others in contests of hardness.',NULL,'Rock Pokémon'),(75,'graveler',1,'Rolls down slopes to move. It rolls over any\nobstacle without slowing or changing its direction.',NULL,'Rock Pokémon'),(76,'golem',1,'Even dynamite can’t harm its hard, boulder-like\nbody. It sheds its hide just once a year.',NULL,'Megaton Pokémon'),(77,'ponyta',1,'It can’t run properly when it’s newly born.\nAs it races around with others of its kind,\nits legs grow stronger.',NULL,'Fire Horse Pokémon'),(78,'rapidash',1,'This Pokémon can be seen galloping through\nfields at speeds of up to 150 mph, its fiery mane\nfluttering in the wind.',NULL,'Fire Horse Pokémon'),(79,'slowpoke',1,'Slow-witted and oblivious, this Pokémon won’t\nfeel any pain if its tail gets eaten. It won’t notice\nwhen its tail grows back, either.',NULL,'Dopey Pokémon'),(80,'slowbro',1,'Slowpoke became Slowbro when a Shellder bit\non to its tail. Sweet flavors seeping from the tail\nmake the Shellder feel as if its life is a dream.',NULL,'Hermit Crab Pokémon'),(81,'magnemite',1,'At times, Magnemite runs out of electricity and\nends up on the ground. If you give batteries to a\ngrounded Magnemite, it’ll start moving again.',NULL,'Magnet Pokémon'),(82,'magneton',1,'This Pokémon is three Magnemite that have\nlinked together. Magneton sends out powerful\nradio waves to study its surroundings.',NULL,'Magnet Pokémon'),(83,'farfetchd',1,'The stalk this Pokémon carries in its wings serves\nas a sword to cut down opponents. In a dire\nsituation, the stalk can also serve as food.',NULL,'Wild Duck Pokémon'),(84,'doduo',1,'The brains in its two heads appear to communicate\nemotions to each other with a telepathic power.',NULL,'Twin Bird Pokémon'),(85,'dodrio',1,'An odd species that is rarely found. The three\nheads respectively represent joy, sadness,\nand anger.',NULL,'Triple Bird Pokémon'),(86,'seel',1,'Covered with light blue fur, its hide is thick and\ntough. It is active in bitter cold of\n-40 degrees Fahrenheit.',NULL,'Sea Lion Pokémon'),(87,'dewgong',1,'Its streamlined body has little drag in water.\nThe colder the temperature, the friskier it gets.',NULL,'Sea Lion Pokémon'),(88,'grimer',1,'Appears in filthy areas. It thrives by sucking up\npolluted sludge that is pumped out of factories.',NULL,'Sludge Pokémon'),(89,'muk',1,'A toxic fluid seeps from its body. The fluid instantly\nkills plants and trees on contact.',NULL,'Sludge Pokémon'),(90,'shellder',1,'It swims facing backward by opening and closing\nits two-piece shell. It is surprisingly fast.',NULL,'Bivalve Pokémon'),(91,'cloyster',1,'Its shell is extremely hard. It cannot be shattered,\neven with a bomb. The shell opens only when it\nis attacking.',NULL,'Bivalve Pokémon'),(92,'gastly',1,'Born from gases, anyone would faint if engulfed\nby its gaseous body, which contains poison.',NULL,'Gas Pokémon'),(93,'haunter',1,'Its tongue is made of gas. If licked, its victim\nstarts shaking constantly until death\neventually comes.',NULL,'Gas Pokémon'),(94,'gengar',1,'On the night of a full moon, if shadows move on\ntheir own and laugh, it must be Gengar’s doing.',NULL,'Shadow Pokémon'),(95,'onix',1,'As it digs through the ground, it absorbs many\nhard objects. This is what makes its body so solid.',NULL,'Rock Snake Pokémon'),(96,'drowzee',1,'If you think that you had a good dream but you\ncan’t remember it, a Drowzee has probably eaten it.',NULL,'Hypnosis Pokémon'),(97,'hypno',1,'Seeing its swinging pendulum can induce sleep in\nthree seconds, even in someone who just woke up.',NULL,'Hypnosis Pokémon'),(98,'krabby',1,'It can be found near the sea. The large pincers\ngrow back if they are torn out of their sockets.',NULL,'River Crab Pokémon'),(99,'kingler',1,'Its large and hard pincer has 10,000-horsepower\nstrength. However, being so big, it is unwieldy\nto move.',NULL,'Pincer Pokémon'),(100,'voltorb',1,'Usually found in power plants. Easily mistaken for a\nPoké Ball, it has zapped many people.',NULL,'Ball Pokémon'),(101,'electrode',1,'It stores an overflowing amount of electric energy\ninside its body. Even a small shock makes\nit explode.',NULL,'Ball Pokémon'),(102,'exeggcute',1,'Though it may look like it’s just a bunch of eggs,\nit’s a proper Pokémon. Exeggcute communicates\nwith others of its kind via telepathy, apparently.',NULL,'Egg Pokémon'),(103,'exeggutor',1,'Each of Exeggutor’s three heads is thinking\ndifferent thoughts. The three don’t seem to be\nvery interested in one another.',NULL,'Coconut Pokémon'),(104,'cubone',1,'When the memory of its departed mother brings\nit to tears, its cries echo mournfully within the\nskull it wears on its head.',NULL,'Lonely Pokémon'),(105,'marowak',1,'This Pokémon overcame its sorrow to evolve a\nsturdy new body. Marowak faces its opponents\nbravely, using a bone as a weapon.',NULL,'Bone Keeper Pokémon'),(106,'hitmonlee',1,'This amazing Pokémon has an awesome sense of\nbalance. It can kick in succession from any position.',NULL,'Kicking Pokémon'),(107,'hitmonchan',1,'Its punches slice the air. They are launched at\nsuch high speed, even a slight graze could cause\na burn.',NULL,'Punching Pokémon'),(108,'lickitung',1,'If this Pokémon’s sticky saliva gets on you and\nyou don’t clean it off, an intense itch will set in.\nThe itch won’t go away, either.',NULL,'Licking Pokémon'),(109,'koffing',1,'Its body is full of poisonous gas. It floats into\ngarbage dumps, seeking out the fumes of raw,\nrotting trash.',NULL,'Poison Gas Pokémon'),(110,'weezing',1,'It mixes gases between its two bodies.\nIt’s said that these Pokémon were seen\nall over the Galar region back in the day.',NULL,'Poison Gas Pokémon'),(111,'rhyhorn',1,'Strong, but not too bright, this Pokémon can\nshatter even a skyscraper with its charging tackles.',NULL,'Spikes Pokémon'),(112,'rhydon',1,'It begins walking on its hind legs after evolution.\nIt can punch holes through boulders with its horn.',NULL,'Drill Pokémon'),(113,'chansey',1,'The egg Chansey carries is not only delicious\nbut also packed with nutrition. It’s used as a\nhigh-class cooking ingredient.',NULL,'Egg Pokémon'),(114,'tangela',1,'Hidden beneath a tangle of vines that grows\nnonstop even if the vines are torn off, this\nPokémon’s true appearance remains a mystery.',NULL,'Vine Pokémon'),(115,'kangaskhan',1,'Although it’s carrying its baby in a pouch on\nits belly, Kangaskhan is swift on its feet. It\nintimidates its opponents with quick jabs.',NULL,'Parent Pokémon'),(116,'horsea',1,'Horsea makes its home in oceans with gentle\ncurrents. If this Pokémon is under attack, it spits\nout pitch-black ink and escapes.',NULL,'Dragon Pokémon'),(117,'seadra',1,'It’s the males that raise the offspring. While\nSeadra are raising young, the spines on their\nbacks secrete thicker and stronger poison.',NULL,'Dragon Pokémon'),(118,'goldeen',1,'Its dorsal, pectoral, and tail fins wave elegantly\nin water. That is why it is known as the Water Dancer.',NULL,'Goldfish Pokémon'),(119,'seaking',1,'In autumn, its body becomes more fatty in\npreparing to propose to a mate. It takes on\nbeautiful colors.',NULL,'Goldfish Pokémon'),(120,'staryu',1,'If you visit a beach at the end of summer, you’ll\nbe able to see groups of Staryu lighting up in a\nsteady rhythm.',NULL,'Star Shape Pokémon'),(121,'starmie',1,'This Pokémon has an organ known as its core.\nThe organ glows in seven colors when Starmie is\nunleashing its potent psychic powers.',NULL,'Mysterious Pokémon'),(122,'mr-mime',1,'The broadness of its hands may be no\ncoincidence—many scientists believe its palms\nbecame enlarged specifically for pantomiming.',NULL,'Barrier Pokémon'),(123,'scyther',1,'As Scyther fights more and more battles, its\nscythes become sharper and sharper. With a\nsingle slice, Scyther can fell a massive tree.',NULL,'Mantis Pokémon'),(124,'jynx',1,'In certain parts of Galar, Jynx was once feared\nand worshiped as the Queen of Ice.',NULL,'Human Shape Pokémon'),(125,'electabuzz',1,'Many power plants keep Ground-type Pokémon\naround as a defense against Electabuzz that\ncome seeking electricity.',NULL,'Electric Pokémon'),(126,'magmar',1,'Magmar dispatches its prey with fire. But it\nregrets this habit once it realizes that it has\nburned its intended prey to a charred crisp.',NULL,'Spitfire Pokémon'),(127,'pinsir',1,'These Pokémon judge one another based on\npincers. Thicker, more impressive pincers make\nfor more popularity with the opposite gender.',NULL,'Stag Beetle Pokémon'),(128,'tauros',1,'When Tauros begins whipping itself with its tails,\nit’s a warning that the Pokémon is about to\ncharge with astounding speed.',NULL,'Wild Bull Pokémon'),(129,'magikarp',1,'It is virtually worthless in terms of both power\nand speed. It is the most weak and pathetic\nPokémon in the world.',NULL,'Fish Pokémon'),(130,'gyarados',1,'It has an extremely aggressive nature.\nThe Hyper Beam it shoots from its mouth\ntotally incinerates all targets.',NULL,'Atrocious Pokémon'),(131,'lapras',1,'A smart and kindhearted Pokémon,\nit glides across the surface of the sea while\nits beautiful song echoes around it.',NULL,'Transport Pokémon'),(132,'ditto',1,'It can reconstitute its entire cellular\nstructure to change into what it sees,\nbut it returns to normal when it relaxes.',NULL,'Transform Pokémon'),(133,'eevee',1,'It has the ability to alter the composition of its\nbody to suit its surrounding environment.',NULL,'Evolution Pokémon'),(134,'vaporeon',1,'When Vaporeon’s fins begin to vibrate, it is a\nsign that rain will come within a few hours.',NULL,'Bubble Jet Pokémon'),(135,'jolteon',1,'If it is angered or startled, the fur all over its\nbody bristles like sharp needles that pierce foes.',NULL,'Lightning Pokémon'),(136,'flareon',1,'Once it has stored up enough heat, this\nPokémon’s body temperature can reach up to\n1,700 degrees Fahrenheit.',NULL,'Flame Pokémon'),(137,'porygon',1,'State-of-the-art technology was used to create\nPorygon. It was the first artificial Pokémon to be\ncreated via computer programming.',NULL,'Virtual Pokémon'),(138,'omanyte',1,'Because some Omanyte manage to escape after\nbeing restored or are released into the wild by\npeople, this species is becoming a problem.',NULL,'Spiral Pokémon'),(139,'omastar',1,'Weighed down by a large and heavy shell,\nOmastar couldn’t move very fast. Some say it\nwent extinct because it was unable to catch food.',NULL,'Spiral Pokémon'),(140,'kabuto',1,'This species is almost entirely extinct. Kabuto\nmolt every three days, making their shells harder\nand harder.',NULL,'Shellfish Pokémon'),(141,'kabutops',1,'Kabutops slices its prey apart and sucks out\nthe fluids. The discarded body parts become\nfood for other Pokémon.',NULL,'Shellfish Pokémon'),(142,'aerodactyl',1,'This is a ferocious Pokémon from ancient times.\nApparently even modern technology is incapable\nof producing a perfectly restored specimen.',NULL,'Fossil Pokémon'),(143,'snorlax',1,'It is not satisfied unless it eats over 880 pounds\nof food every day. When it is done eating, it\ngoes promptly to sleep.',NULL,'Sleeping Pokémon'),(144,'articuno',1,'It’s said that this Pokémon’s beautiful blue wings\nare made of ice. Articuno flies over snowy\nmountains, its long tail fluttering along behind it.',NULL,'Freeze Pokémon'),(145,'zapdos',1,'This Pokémon has complete control over\nelectricity. There are tales of Zapdos nesting in\nthe dark depths of pitch-black thunderclouds.',NULL,'Electric Pokémon'),(146,'moltres',1,'It’s one of the legendary bird Pokémon. When\nMoltres flaps its flaming wings, they glimmer with\na dazzling red glow.',NULL,'Flame Pokémon'),(147,'dratini',1,'Dratini dwells near bodies of rapidly flowing\nwater, such as the plunge pools of waterfalls.\nAs it grows, Dratini will shed its skin many times.',NULL,'Dragon Pokémon'),(148,'dragonair',1,'This Pokémon lives in pristine oceans and lakes.\nIt can control the weather, and it uses this power\nto fly into the sky, riding on the wind.',NULL,'Dragon Pokémon'),(149,'dragonite',1,'It’s a kindhearted Pokémon. If it spots a drowning\nperson or Pokémon, Dragonite simply must\nhelp them.',NULL,'Dragon Pokémon'),(150,'mewtwo',1,'A Pokémon created by recombining Mew’s genes.\nIt’s said to have the most savage heart\namong Pokémon.',NULL,'Genetic Pokémon'),(151,'mew',1,'Its DNA is said to contain the genetic codes of all\nPokémon, so it can use all kinds of techniques.',NULL,'New Species Pokémon'),(152,'chikorita',2,'It uses the leaf on its head to determine the\ntemperature and humidity. It loves to sunbathe.',NULL,'Leaf Pokémon'),(153,'bayleef',2,'The buds that ring its neck give off a spicy aroma\nthat perks people up.',NULL,'Leaf Pokémon'),(154,'meganium',2,'Meganium’s breath has the power to revive dead\ngrass and plants. It can make them healthy again.',NULL,'Herb Pokémon'),(155,'cyndaquil',2,'It has a timid nature. If it is startled, the flames on\nits back burn more vigorously.',NULL,'Fire Mouse Pokémon'),(156,'quilava',2,'Be careful if it turns its back during battle. It means\nthat it will attack with the fire on its back.',NULL,'Volcano Pokémon'),(157,'typhlosion',2,'It has a secret, devastating move. It rubs its blazing\nfur together to cause huge explosions.',NULL,'Volcano Pokémon'),(158,'totodile',2,'Its powerful, well-developed jaws are capable of\ncrushing anything. Even its Trainer must be careful.',NULL,'Big Jaw Pokémon'),(159,'croconaw',2,'Once it bites down, it won’t let go until it loses its\nfangs. New fangs quickly grow into place.',NULL,'Big Jaw Pokémon'),(160,'feraligatr',2,'When it bites with its massive and powerful jaws,\nit shakes its head and savagely tears its victim up.',NULL,'Big Jaw Pokémon'),(161,'sentret',2,'It stands on its tail so it can see a long way.\nIf it spots an enemy, it cries loudly to warn its kind.',NULL,'Scout Pokémon'),(162,'furret',2,'It makes a nest to suit its long and skinny body.\nThe nest is impossible for other Pokémon to enter.',NULL,'Long Body Pokémon'),(163,'hoothoot',2,'It always stands on one foot. It changes feet so\nfast, the movement can rarely be seen.',NULL,'Owl Pokémon'),(164,'noctowl',2,'Its eyes are specially developed to enable it to\nsee clearly even in murky darkness and minimal light.',NULL,'Owl Pokémon'),(165,'ledyba',2,'It is timid and clusters together with others.\nThe fluid secreted by its feet indicates its location.',NULL,'Five Star Pokémon'),(166,'ledian',2,'The spot patterns on its back grow larger or smaller\ndepending on the number of stars in the night sky.',NULL,'Five Star Pokémon'),(167,'spinarak',2,'It lies still in the same pose for days in its web,\nwaiting for its unsuspecting prey to wander close.',NULL,'String Spit Pokémon'),(168,'ariados',2,'It attaches silk to its prey and sets it free. Later,\nit tracks the silk to the prey and its friends.',NULL,'Long Leg Pokémon'),(169,'crobat',2,'Both of its legs have turned into wings. Without a\nsound, Crobat flies swiftly toward its prey and\nsinks its fangs into the nape of its target’s neck.',NULL,'Bat Pokémon'),(170,'chinchou',2,'Its antennae, which evolved from a fin, have both\npositive and negative charges flowing through them.',NULL,'Angler Pokémon'),(171,'lanturn',2,'The light it emits is so bright that it can illuminate\nthe sea’s surface from a depth of over three miles.',NULL,'Light Pokémon'),(172,'pichu',2,'Despite its small size, it can zap even adult\nhumans. However, if it does so, it also\nsurprises itself.',NULL,'Tiny Mouse Pokémon'),(173,'cleffa',2,'According to local rumors, Cleffa are often seen\nin places where shooting stars have fallen.',NULL,'Star Shape Pokémon'),(174,'igglybuff',2,'Igglybuff loves to sing. Its marshmallow-like body\ngives off a faint sweet smell.',NULL,'Balloon Pokémon'),(175,'togepi',2,'The shell seems to be filled with joy. It is said\nthat it will share good luck when treated kindly.',NULL,'Spike Ball Pokémon'),(176,'togetic',2,'They say that it will appear before kindhearted,\ncaring people and shower them with happiness.',NULL,'Happiness Pokémon'),(177,'natu',2,'It is extremely good at climbing tree trunks and\nlikes to eat the new sprouts on the trees.',NULL,'Tiny Bird Pokémon'),(178,'xatu',2,'They say that it stays still and quiet because it is\nseeing both the past and future at the same time.',NULL,'Mystic Pokémon'),(179,'mareep',2,'It stores lots of air in its soft fur, allowing it to stay\ncool in summer and warm in winter.',NULL,'Wool Pokémon'),(180,'flaaffy',2,'If its coat becomes fully charged with electricity,\nits tail lights up. It fires hair that zaps on impact.',NULL,'Wool Pokémon'),(181,'ampharos',2,'The tail’s tip shines brightly and can be seen from\nfar away. It acts as a beacon for lost people.',NULL,'Light Pokémon'),(182,'bellossom',2,'Plentiful in the tropics. When it dances, its petals\nrub together and make a pleasant ringing sound.',NULL,'Flower Pokémon'),(183,'marill',2,'This Pokémon uses its round tail as a float. The\nball of Marill’s tail is filled with nutrients that\nhave been turned into an oil.',NULL,'Aqua Mouse Pokémon'),(184,'azumarill',2,'It spends most of its time in the water. On sunny\ndays, Azumarill floats on the surface of the water\nand sunbathes.',NULL,'Aqua Rabbit Pokémon'),(185,'sudowoodo',2,'If a tree branch shakes when there is no wind, it’s\na Sudowoodo, not a tree. It hides from the rain.',NULL,'Imitation Pokémon'),(186,'politoed',2,'At nightfall, these Pokémon appear on the shores\nof lakes. They announce their territorial claims by\nletting out cries that sound like shouting.',NULL,'Frog Pokémon'),(187,'hoppip',2,'It drifts on winds. It is said that when Hoppip gather\nin fields and mountains, spring is on the way.',NULL,'Cottonweed Pokémon'),(188,'skiploom',2,'It spreads its petals to absorb sunlight. It also floats\nin the air to get closer to the sun.',NULL,'Cottonweed Pokémon'),(189,'jumpluff',2,'Even in the fiercest wind, it can control its fluff to\nmake its way to any place in the world it wants.',NULL,'Cottonweed Pokémon'),(190,'aipom',2,'Its tail is so powerful that it can use it to grab a\ntree branch and hold itself up in the air.',NULL,'Long Tail Pokémon'),(191,'sunkern',2,'It lives by drinking only dewdrops from under the\nleaves of plants. It is said that it eats nothing else.',NULL,'Seed Pokémon'),(192,'sunflora',2,'It gets energy from warm sunlight and is known for\nits habit of moving in pursuit of it.',NULL,'Sun Pokémon'),(193,'yanma',2,'If it flaps its wings really fast, it can generate shock\nwaves that will shatter windows in the area.',NULL,'Clear Wing Pokémon'),(194,'wooper',2,'This Pokémon lives in cold water. It will leave the\nwater to search for food when it gets cold outside.',NULL,'Water Fish Pokémon'),(195,'quagsire',2,'It has an easygoing nature. It 