rticularly beautiful Corsola\nbranches as charms to promote safe childbirth.',NULL,'Coral Pokémon'),(223,'remoraid',2,'The water they shoot from their mouths can hit\nmoving prey from more than 300 feet away.',NULL,'Jet Pokémon'),(224,'octillery',2,'It has a tendency to want to be in holes. It\nprefers rock crags or pots and sprays ink from\nthem before attacking.',NULL,'Jet Pokémon'),(225,'delibird',2,'It carries food all day long. There are tales about\nlost people who were saved by the food it had.',NULL,'Delivery Pokémon'),(226,'mantine',2,'If it builds up enough speed swimming, it\ncan jump out above the waves and glide\nfor over 300 feet.',NULL,'Kite Pokémon'),(227,'skarmory',2,'The pointed feathers of these Pokémon are\nsharper than swords. Skarmory and Corviknight\nfight viciously over territory.',NULL,'Armor Bird Pokémon'),(228,'houndour',2,'To corner prey, they check each other’s location\nusing barks that only they can understand.',NULL,'Dark Pokémon'),(229,'houndoom',2,'The flames it breathes when angry contain toxins.\nIf they cause a burn, it will hurt forever.',NULL,'Dark Pokémon'),(230,'kingdra',2,'With the arrival of a storm at sea, this Pokémon\nwill show itself on the surface. When a Kingdra\nand a Dragonite meet, a fierce battle ensues.',NULL,'Dragon Pokémon'),(231,'phanpy',2,'It is strong despite its compact size. It can easily\npick up and carry an adult human on its back.',NULL,'Long Nose Pokémon'),(232,'donphan',2,'The longer and bigger its tusks, the higher its rank\nin its herd. The tusks take long to grow.',NULL,'Armor Pokémon'),(233,'porygon2',2,'This is a Porygon that was updated with special\ndata. Porygon2 develops itself by learning about\nmany different subjects all on its own.',NULL,'Virtual Pokémon'),(234,'stantler',2,'The curved antlers subtly change the flow of air to\ncreate a strange space where reality is distorted.',NULL,'Big Horn Pokémon'),(235,'smeargle',2,'Once it becomes an adult, it has a tendency to let\nits comrades plant footprints on its back.',NULL,'Painter Pokémon'),(236,'tyrogue',2,'It is always bursting with energy. To make itself\nstronger, it keeps on fighting even if it loses.',NULL,'Scuffle Pokémon'),(237,'hitmontop',2,'It launches kicks while spinning. If it spins at high\nspeed, it may bore its way into the ground.',NULL,'Handstand Pokémon'),(238,'smoochum',2,'If its face gets even slightly dirty, Smoochum will\nbathe immediately. But if its body gets dirty,\nSmoochum doesn’t really seem to care.',NULL,'Kiss Pokémon'),(239,'elekid',2,'When a storm approaches, this Pokémon gets\nrestless. Once Elekid hears the sound of thunder,\nit gets full-on rowdy.',NULL,'Electric Pokémon'),(240,'magby',2,'This Pokémon is still small and timid.\nWhenever Magby gets excited or surprised,\nflames leak from its mouth and its nose.',NULL,'Live Coal Pokémon'),(241,'miltank',2,'Miltank produces highly nutritious milk, so it’s\nbeen supporting the lives of people and other\nPokémon since ancient times.',NULL,'Milk Cow Pokémon'),(242,'blissey',2,'Whenever a Blissey finds a weakened Pokémon,\nit will share its egg and offer its care until the\nother Pokémon is all better.',NULL,'Happiness Pokémon'),(243,'raikou',2,'This rough Pokémon stores energy inside its body,\nthen sweeps across the land, shooting\noff electricity.',NULL,'Thunder Pokémon'),(244,'entei',2,'It is said that when it roars, a volcano erupts\nsomewhere around the globe.',NULL,'Volcano Pokémon'),(245,'suicune',2,'Said to be the embodiment of north winds, it can\ninstantly purify filthy, murky water.',NULL,'Aurora Pokémon'),(246,'larvitar',2,'Born deep underground, it comes\naboveground and becomes a pupa once it\nhas finished eating the surrounding soil.',NULL,'Rock Skin Pokémon'),(247,'pupitar',2,'Even sealed in its shell, it can move freely.\nHard and fast, it has outstanding\ndestructive power.',NULL,'Hard Shell Pokémon'),(248,'tyranitar',2,'Its body can’t be harmed by any sort of attack,\nso it is very eager to make challenges\nagainst enemies.',NULL,'Armor Pokémon'),(249,'lugia',2,'It is said to be the guardian of the seas. It is\nrumored to have been seen on the night of a storm.',NULL,'Diving Pokémon'),(250,'ho-oh',2,'It will reveal itself before a pure-hearted Trainer by\nshining its bright, rainbow-colored wings.',NULL,'Rainbow Pokémon'),(251,'celebi',2,'This Pokémon has the ability to move through\ntime. Records describing it as a forest deity can\nbe found from many different eras.',NULL,'Time Travel Pokémon'),(252,'treecko',3,'Small hooks on the bottom of its feet catch on\nwalls and ceilings. That is how it can hang\nfrom above.',NULL,'Wood Gecko Pokémon'),(253,'grovyle',3,'It lives in dense jungles. While closing in on its\nprey, it leaps from branch to branch.',NULL,'Wood Gecko Pokémon'),(254,'sceptile',3,'It agilely leaps about the jungle and uses the sharp\nleaves on its arms to strike its prey.',NULL,'Forest Pokémon'),(255,'torchic',3,'A fire burns inside, so it feels very warm to hug.\nIt launches fireballs of 1,800 degrees Fahrenheit.',NULL,'Chick Pokémon'),(256,'combusken',3,'During a battle, the hot flame in its body increases.\nIts kicks have outstanding destructive power.',NULL,'Young Fowl Pokémon'),(257,'blaziken',3,'When facing a tough foe, it looses flames from\nits wrists. Its powerful legs let it jump clear\nover buildings.',NULL,'Blaze Pokémon'),(258,'mudkip',3,'To alert it, the fin on its head senses the flow of\nwater. It has the strength to heft boulders.',NULL,'Mud Fish Pokémon'),(259,'marshtomp',3,'Living on muddy ground that provides poor footing\nhas made its legs sturdy.',NULL,'Mud Fish Pokémon'),(260,'swampert',3,'It can swim while towing a large ship. It bashes\ndown foes with a swing of its thick arms.',NULL,'Mud Fish Pokémon'),(261,'poochyena',3,'It has a very tenacious nature. Its acute sense of\nsmell lets it chase a chosen prey without ever\nlosing track.',NULL,'Bite Pokémon'),(262,'mightyena',3,'It chases down prey in a pack of around ten.\nThey defeat foes with perfectly\ncoordinated teamwork.',NULL,'Bite Pokémon'),(263,'zigzagoon',3,'It marks its territory by rubbing its bristly fur on\ntrees. This variety of Zigzagoon is friendlier and\ncalmer than the kind native to Galar.',NULL,'Tiny Raccoon Pokémon'),(264,'linoone',3,'Its fur is strong and supple. Shaving brushes\nmade with shed Linoone hairs are highly prized.',NULL,'Rushing Pokémon'),(265,'wurmple',3,'It lives among the tall grass and in forests. It repels\nattacks by raising up the spikes on its rear.',NULL,'Worm Pokémon'),(266,'silcoon',3,'It drinks dew that collects on its silk and waits for\nevolution. Its hard cocoon repels attacks.',NULL,'Cocoon Pokémon'),(267,'beautifly',3,'It has an aggressive nature. It stabs prey with its\nlong, narrow mouth to drain the prey’s fluids.',NULL,'Butterfly Pokémon'),(268,'cascoon',3,'It never forgets any attack it endured while in the\ncocoon. After evolution, it seeks payback.',NULL,'Cocoon Pokémon'),(269,'dustox',3,'It violently flutters its wings to scatter toxic dust\nwhen attacked. It becomes active after sunset.',NULL,'Poison Moth Pokémon'),(270,'lotad',3,'It searches about for clean water. If it does not\ndrink water for too long, the leaf on its\nhead wilts.',NULL,'Water Weed Pokémon'),(271,'lombre',3,'It is nocturnal and becomes active at nightfall.\nIt feeds on aquatic mosses that grow\nin the riverbed.',NULL,'Jolly Pokémon'),(272,'ludicolo',3,'The rhythm of bright, festive music activates\nLudicolo’s cells, making it more powerful.',NULL,'Carefree Pokémon'),(273,'seedot',3,'If it remains still, it looks just like a real nut.\nIt delights in surprising foraging Pokémon.',NULL,'Acorn Pokémon'),(274,'nuzleaf',3,'It lives deep in forests. With the leaf on its head,\nit makes a flute whose song makes listeners uneasy.',NULL,'Wily Pokémon'),(275,'shiftry',3,'A Pokémon that was feared as a forest guardian.\nIt can read the foe’s mind and take\npreemptive action.',NULL,'Wicked Pokémon'),(276,'taillow',3,'It dislikes cold seasons. They migrate to other\nlands in search of warmth, flying over 180 miles\na day.',NULL,'Tiny Swallow Pokémon'),(277,'swellow',3,'It dives at a steep angle as soon as it spots its\nprey. It catches its prey with sharp claws.',NULL,'Swallow Pokémon'),(278,'wingull',3,'It makes its nest on sheer cliffs. Riding the sea\nbreeze, it glides up into the expansive skies.',NULL,'Seagull Pokémon'),(279,'pelipper',3,'It is a messenger of the skies, carrying small\nPokémon and eggs to safety in its bill.',NULL,'Water Bird Pokémon'),(280,'ralts',3,'It is highly attuned to the emotions of people\nand Pokémon. It hides if it senses hostility.',NULL,'Feeling Pokémon'),(281,'kirlia',3,'If its Trainer becomes happy, it overflows with\nenergy, dancing joyously while spinning about.',NULL,'Emotion Pokémon'),(282,'gardevoir',3,'It has the power to predict the future. Its power\npeaks when it is protecting its Trainer.',NULL,'Embrace Pokémon'),(283,'surskit',3,'It appears as if it is skating on water. It draws prey\nwith a sweet scent from the tip of its head.',NULL,'Pond Skater Pokémon'),(284,'masquerain',3,'It flaps its four wings to hover and fly freely in any\ndirection--to and fro and sideways.',NULL,'Eyeball Pokémon'),(285,'shroomish',3,'It spouts poison spores from the top of its head.\nThese spores cause pain all over if inhaled.',NULL,'Mushroom Pokémon'),(286,'breloom',3,'It scatters poisonous spores and throws powerful\npunches while its foe is hampered by\ninhaled spores.',NULL,'Mushroom Pokémon'),(287,'slakoth',3,'If it eats just three leaves in a day, it is satisfied.\nOther than that, it sleeps for 20 hours a day.',NULL,'Slacker Pokémon'),(288,'vigoroth',3,'Its stress level rises if it cannot keep moving\nconstantly. Too much stress makes it feel sick.',NULL,'Wild Monkey Pokémon'),(289,'slaking',3,'It is the world’s most slothful Pokémon. However,\nit can exert horrifying power by releasing pent-up\nenergy all at once.',NULL,'Lazy Pokémon'),(290,'nincada',3,'Because it lived almost entirely underground,\nit is nearly blind. It uses its antennae instead.',NULL,'Trainee Pokémon'),(291,'ninjask',3,'Its cry leaves a lasting headache if heard for too\nlong. It moves so quickly that it is almost invisible.',NULL,'Ninja Pokémon'),(292,'shedinja',3,'A most peculiar Pokémon that somehow appears\nin a Poké Ball when a Nincada evolves.',NULL,'Shed Pokémon'),(293,'whismur',3,'The cry of a Whismur is over 100 decibels.\nIf you’re close to a Whismur when it lets out a\ncry, you’ll be stuck with an all-day headache.',NULL,'Whisper Pokémon'),(294,'loudred',3,'Loudred’s ears serve as speakers, and they can\nput out sound waves powerful enough to blow\naway a house.',NULL,'Big Voice Pokémon'),(295,'exploud',3,'In the past, people would use the loud voices of\nthese Pokémon as a means of communication\nbetween distant cities.',NULL,'Loud Noise Pokémon'),(296,'makuhita',3,'It grows stronger by enduring harsh training. It is a\ngutsy Pokémon that can withstand any attack.',NULL,'Guts Pokémon'),(297,'hariyama',3,'It loves to match power with big-bodied Pokémon.\nIt can knock a truck flying with its arm thrusts.',NULL,'Arm Thrust Pokémon'),(298,'azurill',3,'The ball on Azurill’s tail bounces like a rubber\nball, and it’s full of the nutrients the Pokémon\nneeds to grow.',NULL,'Polka Dot Pokémon'),(299,'nosepass',3,'Its magnetic nose consistently faces north.\nTravelers check Nosepass to get their bearings.',NULL,'Compass Pokémon'),(300,'skitty',3,'It shows its cute side by chasing its own tail\nuntil it gets dizzy.',NULL,'Kitten Pokémon'),(301,'delcatty',3,'It is highly popular among female Trainers for its\nsublime fur. It does not keep a nest.',NULL,'Prim Pokémon'),(302,'sableye',3,'This Pokémon is feared. When its gemstone eyes\nbegin to glow with a sinister shine, it’s believed\nthat Sableye will steal people’s spirits away.',NULL,'Darkness Pokémon'),(303,'mawile',3,'It uses its docile-looking face to lull foes into\ncomplacency, then bites with its huge,\nrelentless jaws.',NULL,'Deceiver Pokémon'),(304,'aron',3,'It eats iron ore—and sometimes railroad tracks—\nto build up the steel armor that protects its body.',NULL,'Iron Armor Pokémon'),(305,'lairon',3,'Lairon live in mountains brimming with spring\nwater and iron ore, so these Pokémon often\ncame into conflict with humans in the past.',NULL,'Iron Armor Pokémon'),(306,'aggron',3,'Aggron has a horn sharp enough to perforate\nthick iron sheets. It brings down its opponents by\nramming into them horn first.',NULL,'Iron Armor Pokémon'),(307,'meditite',3,'It eats just one berry a day. By enduring hunger,\nits spirit is tempered and made sharper.',NULL,'Meditate Pokémon'),(308,'medicham',3,'Through yoga training, it gained the psychic power\nto predict its foe’s next move.',NULL,'Meditate Pokémon'),(309,'electrike',3,'It stores static electricity in its fur for discharging.\nIt gives off sparks if a storm approaches.',NULL,'Lightning Pokémon'),(310,'manectric',3,'It stimulates its own muscles with electricity, so\nit can move quickly. It eases its soreness with\nelectricity, too, so it can recover quickly as well.',NULL,'Discharge Pokémon'),(311,'plusle',3,'It absorbs electricity from telephone poles. It shorts\nout its body to create crackling noises.',NULL,'Cheering Pokémon'),(312,'minun',3,'It cheers on friends. If its friends are losing,\nits body lets off more and more sparks.',NULL,'Cheering Pokémon'),(313,'volbeat',3,'It lives around clean ponds. At night, its rear lights\nup. It converses with others by flashing its light.',NULL,'Firefly Pokémon'),(314,'illumise',3,'With its sweet aroma, it guides Volbeat to draw\nsigns with light in the night sky.',NULL,'Firefly Pokémon'),(315,'roselia',3,'Its flowers give off a relaxing fragrance.\nThe stronger its aroma, the healthier\nthe Roselia is.',NULL,'Thorn Pokémon'),(316,'gulpin',3,'There is nothing its stomach can’t digest. While it is\ndigesting, vile, overpowering gases are expelled.',NULL,'Stomach Pokémon'),(317,'swalot',3,'It gulps anything that fits in its mouth. Its special\nenzymes can dissolve anything.',NULL,'Poison Bag Pokémon'),(318,'carvanha',3,'It won’t attack while it’s alone—not even if it\nspots prey. Instead, it waits for other Carvanha to\njoin it, and then the Pokémon attack as a group.',NULL,'Savage Pokémon'),(319,'sharpedo',3,'As soon as it catches the scent of prey, Sharpedo\nwill jet seawater from its backside, hurtling\ntoward the target to attack at 75 mph.',NULL,'Brutal Pokémon'),(320,'wailmer',3,'It shows off by spraying jets of seawater from\nthe nostrils above its eyes. It eats a solid ton of\nWishiwashi every day.',NULL,'Ball Whale Pokémon'),(321,'wailord',3,'It can sometimes knock out opponents\nwith the shock created by breaching and\ncrashing its big body onto the water.',NULL,'Float Whale Pokémon'),(322,'numel',3,'The magma in its body reaches 2,200 degrees\nFahrenheit. Its hump gets smaller when it uses\nFire-type moves.',NULL,'Numb Pokémon'),(323,'camerupt',3,'If angered, the humps on its back erupt in a shower\nof molten lava. It lives in the craters of volcanoes.',NULL,'Eruption Pokémon'),(324,'torkoal',3,'It burns coal inside its shell for energy. It blows\nout black soot if it is endangered.',NULL,'Coal Pokémon'),(325,'spoink',3,'It bounces around on its tail to keep its\nheart pumping. It carries a pearl from\nClamperl on its head.',NULL,'Bounce Pokémon'),(326,'grumpig',3,'It uses black pearls to amplify its psychic power.\nIt does an odd dance to gain control over foes.',NULL,'Manipulate Pokémon'),(327,'spinda',3,'The chances of two Spinda having identical spot\npatterns is less than one in four billion.',NULL,'Spot Panda Pokémon'),(328,'trapinch',3,'Its nest is a sloped, bowl-like pit in the desert.\nOnce something has fallen in, there is no escape.',NULL,'Ant Pit Pokémon'),(329,'vibrava',3,'The ultrasonic waves it generates by rubbing its\ntwo wings together cause severe headaches.',NULL,'Vibration Pokémon'),(330,'flygon',3,'This Pokémon hides in the heart of sandstorms\nit creates and seldom appears where people\ncan see it.',NULL,'Mystic Pokémon'),(331,'cacnea',3,'It prefers harsh environments such as deserts.\nIt can survive for 30 days on water stored in\nits body.',NULL,'Cactus Pokémon'),(332,'cacturne',3,'Packs of them follow travelers through the desert\nuntil the travelers can no longer move.',NULL,'Scarecrow Pokémon'),(333,'swablu',3,'Its cottony wings are full of air, making them light\nand fluffy to the touch. Swablu takes diligent care\nof its wings.',NULL,'Cotton Bird Pokémon'),(334,'altaria',3,'As it flies in a calm and relaxed manner, Altaria\nperforms a humming song that would enrapture\nany audience.',NULL,'Humming Pokémon'),(335,'zangoose',3,'Its fur would all stand on end if it smelled a Seviper\nnearby. Its sharp claws tear up its foes.',NULL,'Cat Ferret Pokémon'),(336,'seviper',3,'Constant polishing makes the edge of the blade on\nits tail extremely sharp. It’s Zangoose’s archrival.',NULL,'Fang Snake Pokémon'),(337,'lunatone',3,'The phase of the moon apparently has some\neffect on its power. It’s active on the night of\na full moon.',NULL,'Meteorite Pokémon'),(338,'solrock',3,'When it rotates itself, it gives off light similar to\nthe sun, thus blinding its foes.',NULL,'Meteorite Pokémon'),(339,'barboach',3,'Its slimy body is hard to grasp. In one region, it is\nsaid to have been born from hardened mud.',NULL,'Whiskers Pokémon'),(340,'whiscash',3,'It makes its nest at the bottom of swamps. It will\neat anything—if it is alive, Whiscash will eat it.',NULL,'Whiskers Pokémon'),(341,'corphish',3,'No matter how dirty the water in the river, it will\nadapt and thrive. It has a strong will to survive.',NULL,'Ruffian Pokémon'),(342,'crawdaunt',3,'A rough customer that wildly flails its giant claws.\nIt is said to be extremely hard to raise.',NULL,'Rogue Pokémon'),(343,'baltoy',3,'It moves while spinning around on its single foot.\nSome Baltoy have been seen spinning on\ntheir heads.',NULL,'Clay Doll Pokémon'),(344,'claydol',3,'This mysterious Pokémon started life as an ancient\nclay figurine made over 20,000 years ago.',NULL,'Clay Doll Pokémon'),(345,'lileep',3,'This Pokémon was restored from a fossil.\nLileep once lived in warm seas that existed\napproximately 100,000,000 years ago.',NULL,'Sea Lily Pokémon'),(346,'cradily',3,'It has short legs and can’t walk very fast, but its\nneck and tentacles can extend to over three\ntimes their usual length to nab distant prey.',NULL,'Barnacle Pokémon'),(347,'anorith',3,'This Pokémon was restored from a fossil.\nAnorith lived in the ocean about 100,000,000\nyears ago, hunting with its pair of claws.',NULL,'Old Shrimp Pokémon'),(348,'armaldo',3,'After evolution, this Pokémon emerged onto\nland. Its lower body has become stronger, and\nblows from its tail are devastating.',NULL,'Plate Pokémon'),(349,'feebas',3,'Although unattractive and unpopular, this\nPokémon’s marvelous vitality has made it a\nsubject of research.',NULL,'Fish Pokémon'),(350,'milotic',3,'Milotic has provided inspiration to many artists.\nIt has even been referred to as the most\nbeautiful Pokémon of all.',NULL,'Tender Pokémon'),(351,'castform',3,'It has the ability to change its form into the sun,\nthe rain, or a snow cloud, depending on\nthe weather.',NULL,'Weather Pokémon'),(352,'kecleon',3,'It changes its shading to match its surroundings\nso it can sneak up on prey. Only its belly patterns\nstay fixed.',NULL,'Color Swap Pokémon'),(353,'shuppet',3,'It loves vengeful emotions and hangs in rows under\nthe eaves of houses where vengeful people live.',NULL,'Puppet Pokémon'),(354,'banette',3,'Strong feelings of hatred turned a puppet into a\nPokémon. If it opens its mouth, its cursed\nenergy escapes.',NULL,'Marionette Pokémon'),(355,'duskull',3,'If it finds bad children who won’t listen to their\nparents, it will spirit them away—or so it’s said.',NULL,'Requiem Pokémon'),(356,'dusclops',3,'Its body is entirely hollow. When it opens its\nmouth, it sucks everything in as if it were a\nblack hole.',NULL,'Beckon Pokémon'),(357,'tropius',3,'The bunch of fruit around its neck ripens twice a\nyear and is delicious. It’s a highly favored\ntropical snack.',NULL,'Fruit Pokémon'),(358,'chimecho',3,'Emitting ultrasonic cries, it floats on winds to travel\ngreat distances.',NULL,'Wind Chime Pokémon'),(359,'absol',3,'Swift as the wind, Absol races through fields and\nmountains. Its curved, bow-like horn is acutely\nsensitive to the warning signs of natural disasters.',NULL,'Disaster Pokémon'),(360,'wynaut',3,'It tends to move in a pack. Individuals squash\nagainst one another to toughen their spirits.',NULL,'Bright Pokémon'),(361,'snorunt',3,'It’s said that if they are seen at midnight, they’ll\ncause heavy snow. They eat snow and ice\nto survive.',NULL,'Snow Hat Pokémon'),(362,'glalie',3,'It has a body of ice that won’t melt, even with\nfire. It can instantly freeze moisture in\nthe atmosphere.',NULL,'Face Pokémon'),(363,'spheal',3,'This Pokémon’s body is covered in blubber and\nimpressively round. It’s faster for Spheal to roll\naround than walk.',NULL,'Clap Pokémon'),(364,'sealeo',3,'Sealeo live on top of drift ice. They go swimming\nwhen they’re on the hunt, seeking out their prey\nby scent.',NULL,'Ball Roll Pokémon'),(365,'walrein',3,'Walrein form herds of 20 to 30 individuals.\nWhen a threat appears, the herd’s leader will\nprotect the group with its life.',NULL,'Ice Break Pokémon'),(366,'clamperl',3,'It is protected by a sturdy shell. Once in a lifetime,\nit makes a magnificent pearl.',NULL,'Bivalve Pokémon'),(367,'huntail',3,'It lives deep in the sea. With a tail shaped like a\nsmall fish, it attracts unsuspecting prey.',NULL,'Deep Sea Pokémon'),(368,'gorebyss',3,'Its swimming form is exquisitely elegant.\nWith its thin mouth, it feeds on seaweed\nthat grows between rocks.',NULL,'South Sea Pokémon'),(369,'relicanth',3,'Rock-hard scales and oil-filled swim bladders\nallow this Pokémon to survive the intense water\npressure of the deep sea.',NULL,'Longevity Pokémon'),(370,'luvdisc',3,'During the spawning season, countless Luvdisc\ncongregate at coral reefs, turning the waters pink.',NULL,'Rendezvous Pokémon'),(371,'bagon',3,'Bagon jumps off cliffs every day, trying to\ngrow stronger so that someday it will be able\nto fly.',NULL,'Rock Head Pokémon'),(372,'shelgon',3,'This Pokémon has covered its body in a hard\nshell that has the same composition as bone.\nShelgon stores energy for evolution.',NULL,'Endurance Pokémon'),(373,'salamence',3,'Salamence is an unusual Pokémon in that it\nwas able to evolve a body with wings just by\nconstantly wishing to be able to fly.',NULL,'Dragon Pokémon'),(374,'beldum',3,'From its rear, Beldum emits a magnetic force that\nrapidly pulls opponents in. They get skewered on\nBeldum’s sharp claws.',NULL,'Iron Ball Pokémon'),(375,'metang',3,'Two Beldum have become stuck together via\ntheir own magnetic forces. With two brains, the\nresulting Metang has doubled psychic powers.',NULL,'Iron Claw Pokémon'),(376,'metagross',3,'Because the magnetic powers of these Pokémon\nget stronger in freezing temperatures, Metagross\nliving on snowy mountains are full of energy.',NULL,'Iron Leg Pokémon'),(377,'regirock',3,'Every bit of Regirock’s body is made of stone.\nAs parts of its body erode, this Pokémon sticks\nrocks to itself to repair what’s been lost.',NULL,'Rock Peak Pokémon'),(378,'regice',3,'With cold air that can reach temperatures as low\nas −328 degrees Fahrenheit, Regice instantly\nfreezes any creature that approaches it.',NULL,'Iceberg Pokémon'),(379,'registeel',3,'Registeel’s body is made of a strange material\nthat is flexible enough to stretch and shrink but\nalso more durable than any metal.',NULL,'Iron Pokémon'),(380,'latias',3,'It can telepathically communicate with people. It\nchanges its appearance using its down that\nrefracts light.',NULL,'Eon Pokémon'),(381,'latios',3,'It understands human speech and is highly\nintelligent. It is a tender Pokémon that\ndislikes fighting.',NULL,'Eon Pokémon'),(382,'kyogre',3,'It is said to have widened the seas by causing\ndownpours. It had been asleep in a marine trench.',NULL,'Sea Basin Pokémon'),(383,'groudon',3,'This legendary Pokémon is said to represent the\nland. It went to sleep after dueling Kyogre.',NULL,'Continent Pokémon'),(384,'rayquaza',3,'It flies in the ozone layer, way up high in the sky.\nUntil recently, no one had ever seen it.',NULL,'Sky High Pokémon'),(385,'jirachi',3,'Once every 1,000 years, the singing of a pure\nvoice will rouse this Pokémon from its near-\nperpetual slumber. It wakes for only seven days.',NULL,'Wish Pokémon'),(386,'deoxys',3,'DNA from a space virus mutated and became a\nPokémon. It appears where auroras are seen.',NULL,'DNA Pokémon'),(387,'turtwig',4,'It undertakes photosynthesis with its body, making\noxygen. The leaf on its head wilts if it is thirsty.',NULL,'Tiny Leaf Pokémon'),(388,'grotle',4,'It knows where pure water wells up. It carries fellow\nPokémon there on its back.',NULL,'Grove Pokémon'),(389,'torterra',4,'Small Pokémon occasionally gather on its unmoving\nback to begin building their nests.',NULL,'Continent Pokémon'),(390,'chimchar',4,'The gas made in its belly burns from its rear end.\nThe fire burns weakly when it feels sick.',NULL,'Chimp Pokémon'),(391,'monferno',4,'It uses ceilings and walls to launch aerial attacks.\nIts fiery tail is but one weapon.',NULL,'Playful Pokémon'),(392,'infernape',4,'It tosses its enemies around with agility. It uses all\nits limbs to fight in its own unique style.',NULL,'Flame Pokémon'),(393,'piplup',4,'Because it is very proud, it hates accepting food\nfrom people. Its thick down guards it from cold.',NULL,'Penguin Pokémon'),(394,'prinplup',4,'It lives a solitary life. Its wings deliver wicked blows\nthat can snap even the thickest of trees.',NULL,'Penguin Pokémon'),(395,'empoleon',4,'The three horns that extend from its beak attest to\nits power. The leader has the biggest horns.',NULL,'Emperor Pokémon'),(396,'starly',4,'They flock around mountains and fields, chasing\nafter bug Pokémon. Their singing is noisy\nand annoying.',NULL,'Starling Pokémon'),(397,'staravia',4,'It lives in forests and fields. Squabbles over\nterritory occur when flocks collide.',NULL,'Starling Pokémon'),(398,'staraptor',4,'When Staravia evolve into Staraptor, they leave the\nflock to live alone. They have sturdy wings.',NULL,'Predator Pokémon'),(399,'bidoof',4,'It constantly gnaws on logs and rocks to whittle\ndown its front teeth. It nests alongside water.',NULL,'Plump Mouse Pokémon'),(400,'bibarel',4,'It makes its nest by damming streams with bark and\nmud. It is known as an industrious worker.',NULL,'Beaver Pokémon'),(401,'kricketot',4,'When its antennae hit each other, it sounds like the\nmusic of a xylophone.',NULL,'Cricket Pokémon'),(402,'kricketune',4,'It signals its emotions with its melodies. Scientists\nare studying these melodic patterns.',NULL,'Cricket Pokémon'),(403,'shinx',4,'This Pokémon generates electricity by contracting\nits muscles. Excited trembling is a sign that Shinx\nis generating a tremendous amount of electricity.',NULL,'Flash Pokémon'),(404,'luxio',4,'By joining its tail with that of another Luxio, this\nPokémon can receive some of the other Luxio’s\nelectricity and power up its own electric blasts.',NULL,'Spark Pokémon'),(405,'luxray',4,'Luxray can see through solid objects. It will\ninstantly spot prey trying to hide behind walls,\neven if the walls are thick.',NULL,'Gleam Eyes Pokémon'),(406,'budew',4,'The pollen it releases contains poison. If this\nPokémon is raised on clean water, the poison’s\ntoxicity is increased.',NULL,'Bud Pokémon'),(407,'roserade',4,'After captivating opponents with its sweet scent,\nit lashes them with its thorny whips.',NULL,'Bouquet Pokémon'),(408,'cranidos',4,'A lifelong jungle dweller from 100 million years\nago, it would snap obstructing trees with headbutts.',NULL,'Head Butt Pokémon'),(409,'rampardos',4,'Its skull is as hard as iron. It is a brute that tears\ndown jungle trees while catching prey.',NULL,'Head Butt Pokémon'),(410,'shieldon',4,'It was generated from a fossil dug out of a layer of\nclay that was older than anyone knows. It has a\nsturdy face.',NULL,'Shield Pokémon'),(411,'bastiodon',4,'Any frontal attack is repulsed. It is a docile\nPokémon that feeds on grass and berries.',NULL,'Shield Pokémon'),(412,'burmy',4,'If its cloak is broken in battle, it quickly remakes\nthe cloak with materials nearby.',NULL,'Bagworm Pokémon'),(413,'wormadam',4,'When Burmy evolved, its cloak became a part of\nthis Pokémon’s body. The cloak is never shed.',NULL,'Bagworm Pokémon'),(414,'mothim',4,'It flutters around at night and steals honey from\nthe Combee hive.',NULL,'Moth Pokémon'),(415,'combee',4,'The members of the trio spend all their time\ntogether. Each one has a slightly different taste\nin nectar.',NULL,'Tiny Bee Pokémon'),(416,'vespiquen',4,'It skillfully commands its grubs in battles with its\nenemies. The grubs are willing to risk their lives\nto defend Vespiquen.',NULL,'Beehive Pokémon'),(417,'pachirisu',4,'A pair may be seen rubbing their cheek pouches\ntogether in an effort to share stored electricity.',NULL,'EleSquirrel Pokémon'),(418,'buizel',4,'It inflates the flotation sac around its neck and\npokes its head out of the water to see what is\ngoing on.',NULL,'Sea Weasel Pokémon'),(419,'floatzel',4,'Its flotation sac developed as a result of pursuing\naquatic prey. It can double as a rubber raft.',NULL,'Sea Weasel Pokémon'),(420,'cherubi',4,'It nimbly dashes about to avoid getting pecked\nby bird Pokémon that would love to make off\nwith its small, nutrient-rich storage ball.',NULL,'Cherry Pokémon'),(421,'cherrim',4,'As a bud, it barely moves. It sits still, placidly\nwaiting for sunlight to appear.',NULL,'Blossom Pokémon'),(422,'shellos',4,'This Pokémon’s habitat shapes its physique.\nAccording to some theories, life in warm ocean\nwaters causes this variation to develop.',NULL,'Sea Slug Pokémon'),(423,'gastrodon',4,'Its search for food sometimes leads it onto land,\nwhere it leaves behind a sticky trail of slime as it\npasses through.',NULL,'Sea Slug Pokémon'),(424,'ambipom',4,'To eat, it deftly shucks nuts with its two tails.\nIt rarely uses its arms now.',NULL,'Long Tail Pokémon'),(425,'drifloon',4,'Perhaps seeking company, it approaches children.\nHowever, it often quickly runs away again when\nthe children play too roughly with it.',NULL,'Balloon Pokémon'),(426,'drifblim',4,'Some say this Pokémon is a collection of souls\nburdened with regrets, silently drifting through\nthe dusk.',NULL,'Blimp Pokémon'),(427,'buneary',4,'If both of Buneary’s ears are rolled up, something\nis wrong with its body or mind. It’s a sure sign the\nPokémon is in need of care.',NULL,'Rabbit Pokémon'),(428,'lopunny',4,'Lopunny is constantly monitoring its surroundings.\nIf danger approaches, this Pokémon responds\nwith superdestructive kicks.',NULL,'Rabbit Pokémon'),(429,'mismagius',4,'Its cries sound like incantations to torment the foe.\nIt appears where you least expect it.',NULL,'Magical Pokémon'),(430,'honchkrow',4,'Becoming active at night, it is known to swarm with\nnumerous Murkrow in tow.',NULL,'Big Boss Pokémon'),(431,'glameow',4,'When it’s happy, Glameow demonstrates beautiful\nmovements of its tail, like a dancing ribbon.',NULL,'Catty Pokémon'),(432,'purugly',4,'To make itself appear intimidatingly beefy, it tightly\ncinches its waist with its twin tails.',NULL,'Tiger Cat Pokémon'),(433,'chingling',4,'There is an orb inside its mouth. When it hops,\nthe orb bounces all over and makes a\nringing sound.',NULL,'Bell Pokémon'),(434,'stunky',4,'From its rear, it sprays a foul-smelling liquid at\nopponents. It aims for their faces, and it can hit\nthem from over 16 feet away.',NULL,'Skunk Pokémon'),(435,'skuntank',4,'In its belly, it reserves stinky fluid that it shoots\nfrom its tail during battle. As this Pokémon’s diet\nvaries, so does the stench of its fluid.',NULL,'Skunk Pokémon'),(436,'bronzor',4,'It appears in ancient ruins. The pattern on its\nbody doesn’t come from any culture in the\nGalar region, so it remains shrouded in mystery.',NULL,'Bronze Pokémon'),(437,'bronzong',4,'Some believe it to be a deity that summons rain\nclouds. When angered, it lets out a warning cry\nthat rings out like the tolling of a bell.',NULL,'Bronze Bell Pokémon'),(438,'bonsly',4,'It expels both sweat and tears from its eyes.\nThe sweat is a little salty, while the tears have\na slight bitterness.',NULL,'Bonsai Pokémon'),(439,'mime-jr',4,'It mimics everyone it sees, but it puts extra\neffort into copying the graceful dance steps\nof Mr. Rime as practice.',NULL,'Mime Pokémon'),(440,'happiny',4,'Mimicking Chansey, Happiny will place an egg-\nshaped stone in its belly pouch. Happiny will\ntreasure this stone.',NULL,'Playhouse Pokémon'),(441,'chatot',4,'It can learn and speak human words. If they gather,\nthey all learn the same saying.',NULL,'Music Note Pokémon'),(442,'spiritomb',4,'Exactly 108 spirits gathered to become this\nPokémon. Apparently there are some ill-natured\nspirits in the mix.',NULL,'Forbidden Pokémon'),(443,'gible',4,'Gible prefers to stay in narrow holes in the sides\nof caves heated by geothermal energy. This way,\nGible can stay warm even during a blizzard.',NULL,'Land Shark Pokémon'),(444,'gabite',4,'This Pokémon emits ultrasonic waves from a\nprotrusion on either side of its head to probe\npitch-dark caves.',NULL,'Cave Pokémon'),(445,'garchomp',4,'Garchomp makes its home in volcanic mountains.\nIt flies through the sky as fast as a jet airplane,\nhunting down as much prey as it can.',NULL,'Mach Pokémon'),(446,'munchlax',4,'Stuffing itself with vast amounts of food is its\nonly concern. Whether the food is rotten or\nfresh, yummy or tasteless—it does not care.',NULL,'Big Eater Pokémon'),(447,'riolu',4,'It’s exceedingly energetic, with enough stamina\nto keep running all through the night. Taking it\nfor walks can be a challenging experience.',NULL,'Emanation Pokémon'),(448,'lucario',4,'It controls waves known as auras, which are\npowerful enough to pulverize huge rocks.\nIt uses these waves to take down its prey.',NULL,'Aura Pokémon'),(449,'hippopotas',4,'It moves through the sands with its mouth open,\nswallowing sand along with its prey. It gets rid of\nthe sand by spouting it from its nose.',NULL,'Hippo Pokémon'),(450,'hippowdon',4,'Stones can get stuck in the ports on their bodies.\nDwebble help dislodge such stones, so\nHippowdon look after these Pokémon.',NULL,'Heavyweight Pokémon'),(451,'skorupi',4,'After burrowing into the sand, it waits patiently\nfor prey to come near. This Pokémon and\nSizzlipede share common descent.',NULL,'Scorpion Pokémon'),(452,'drapion',4,'Its poison is potent, but it rarely sees use. This\nPokémon prefers to use physical force instead,\ngoing on rampages with its car-crushing strength.',NULL,'Ogre Scorpion Pokémon'),(453,'croagunk',4,'It makes frightening noises with its poison-filled\ncheek sacs. When opponents flinch, Croagunk\nhits them with a poison jab.',NULL,'Toxic Mouth Pokémon'),(454,'toxicroak',4,'It bounces toward opponents and gouges them\nwith poisonous claws. No more than a scratch\nis needed to knock out its adversaries.',NULL,'Toxic Mouth Pokémon'),(455,'carnivine',4,'It binds itself to trees in marshes. It attracts prey\nwith its sweet-smelling drool and gulps them down.',NULL,'Bug Catcher Pokémon'),(456,'finneon',4,'After long exposure to sunlight, the patterns on its\ntail fins shine vividly when darkness arrives.',NULL,'Wing Fish Pokémon'),(457,'lumineon',4,'To avoid detection by predators, it crawls along the\nseafloor using the two fins on its chest.',NULL,'Neon Pokémon'),(458,'mantyke',4,'Mantyke living in Galar seem to be somewhat\nsluggish. The colder waters of the seas in this\nregion may be the cause.',NULL,'Kite Pokémon'),(459,'snover',4,'It lives on snowy mountains. It sinks its legs into\nthe snow to absorb water and keep its own\ntemperature down.',NULL,'Frost Tree Pokémon'),(460,'abomasnow',4,'If it sees any packs of Darumaka going after\nSnover, it chases them off, swinging its sizable\narms like hammers.',NULL,'Frost Tree Pokémon'),(461,'weavile',4,'They attack their quarry in packs. Prey as large\nas Mamoswine easily fall to the teamwork of\na group of Weavile.',NULL,'Sharp Claw Pokémon'),(462,'magnezone',4,'Some say that Magnezone receives signals from\nspace via the antenna on its head and that it’s\nbeing controlled by some mysterious being.',NULL,'Magnet Area Pokémon'),(463,'lickilicky',4,'Lickilicky’s strange tongue can stretch to many\ntimes the length of its body. No one has figured\nout how Lickilicky’s tongue can stretch so far.',NULL,'Licking Pokémon'),(464,'rhyperior',4,'It can load up to three projectiles per arm into\nthe holes in its hands. What launches out of those\nholes could be either rocks or Roggenrola.',NULL,'Drill Pokémon'),(465,'tangrowth',4,'Tangrowth has two arms that it can extend as it\npleases. Recent research has shown that these\narms are, in fact, bundles of vines.',NULL,'Vine Pokémon'),(466,'electivire',4,'The amount of electrical energy this Pokémon\nproduces is proportional to the rate of its pulse.\nThe voltage jumps while Electivire is battling.',NULL,'Thunderbolt Pokémon'),(467,'magmortar',4,'When Magmortar inhales deeply, the fire burning\nin its belly intensifies, rising in temperature to\nover 3,600 degrees Fahrenheit.',NULL,'Blast Pokémon'),(468,'togekiss',4,'These Pokémon are never seen anywhere near\nconflict or turmoil. In recent times, they’ve hardly\nbeen seen at all.',NULL,'Jubilee Pokémon'),(469,'yanmega',4,'This six-legged Pokémon is easily capable of\ntransporting an adult in flight. The wings on its tail\nhelp it stay balanced.',NULL,'Ogre Darner Pokémon'),(470,'leafeon',4,'Galarians favor the distinctive aroma that drifts\nfrom this Pokémon’s leaves. There’s a popular\nperfume made using that scent.',NULL,'Verdant Pokémon'),(471,'glaceon',4,'Any who become captivated by the beauty of\nthe snowfall that Glaceon creates will be frozen\nbefore they know it.',NULL,'Fresh Snow Pokémon'),(472,'gliscor',4,'Its flight is soundless. It uses its lengthy tail to\ncarry off its prey... Then its elongated fangs do\nthe rest.',NULL,'Fang Scorpion Pokémon'),(473,'mamoswine',4,'This Pokémon can be spotted in wall paintings\nfrom as far back as 10,000 years ago. For a\nwhile, it was thought to have gone extinct.',NULL,'Twin Tusk Pokémon'),(474,'porygon-z',4,'Porygon-Z had a program installed to allow it to\nmove between dimensions, but the program also\ncaused instability in Porygon-Z’s behavior.',NULL,'Virtual Pokémon'),(475,'gallade',4,'True to its honorable-warrior image, it uses\nthe blades on its elbows only in defense of\nsomething or someone.',NULL,'Blade Pokémon'),(476,'probopass',4,'It freely controls three small units called Mini-Noses\nusing magnetic force.',NULL,'Compass Pokémon'),(477,'dusknoir',4,'At the bidding of transmissions from the spirit\nworld, it steals people and Pokémon away.\nNo one knows whether it has a will of its own.',NULL,'Gripper Pokémon'),(478,'froslass',4,'After a woman met her end on a snowy mountain,\nher regrets lingered on. From them, this Pokémon\nwas born. Its favorite food is frozen souls.',NULL,'Snow Land Pokémon'),(479,'rotom',4,'One boy’s invention led to the development of\nmany different machines that take advantage of\nRotom’s unique capabilities.',NULL,'Plasma Pokémon'),(480,'uxie',4,'It is said that its emergence gave humans the\nintelligence to improve their quality of life.',NULL,'Knowledge Pokémon'),(481,'mesprit',4,'It sleeps at the bottom of a lake. Its spirit is said to\nleave its body to fly on the lake’s surface.',NULL,'Emotion Pokémon'),(482,'azelf',4,'It is thought that Uxie, Mesprit, and Azelf all came\nfrom the same egg.',NULL,'Willpower Pokémon'),(483,'dialga',4,'It has the power to control time. It appears in\nSinnoh-region myths as an ancient deity.',NULL,'Temporal Pokémon'),(484,'palkia',4,'It has the ability to distort space. It is described as\na deity in Sinnoh-region mythology.',NULL,'Spatial Pokémon'),(485,'heatran',4,'Boiling blood, like magma, circulates through its\nbody. It makes its dwelling place in volcanic caves.',NULL,'Lava Dome Pokémon'),(486,'regigigas',4,'All over the world, there are legends that tell\nof Regigigas creating other Pokémon in its\nown image.',NULL,'Colossal Pokémon'),(487,'giratina',4,'It was banished for its violence. It silently gazed\nupon the old world from the Distortion World.',NULL,'Renegade Pokémon'),(488,'cresselia',4,'Those who sleep holding Cresselia’s feather are\nassured of joyful dreams. It is said to represent\nthe crescent moon.',NULL,'Lunar Pokémon'),(489,'phione',4,'It drifts in warm seas. It always returns to where it\nwas born, no matter how far it may have drifted.',NULL,'Sea Drifter Pokémon'),(490,'manaphy',4,'It starts its life with a wondrous power that permits\nit to bond with any kind of Pokémon.',NULL,'Seafaring Pokémon'),(491,'darkrai',4,'It can lull people to sleep and make them dream.\nIt is active during nights of the new moon.',NULL,'Pitch-Black Pokémon'),(492,'shaymin',4,'The blooming of Gracidea flowers confers the\npower of flight upon it. Feelings of gratitude are\nthe message it delivers.',NULL,'Gratitude Pokémon'),(493,'arceus',4,'It is told in mythology that this Pokémon was born\nbefore the universe even existed.',NULL,'Alpha Pokémon'),(494,'victini',5,'When it shares the infinite energy it creates,\nthat being’s entire body will be overflowing\nwith power.',NULL,'Victory Pokémon'),(495,'snivy',5,'They photosynthesize by bathing their tails in\nsunlight. When they are not feeling well, their\ntails droop.',NULL,'Grass Snake Pokémon'),(496,'servine',5,'When it gets dirty, its leaves can’t be used in\nphotosynthesis, so it always keeps itself clean.',NULL,'Grass Snake Pokémon'),(497,'serperior',5,'It can stop its opponents’ movements with just a\nglare. It takes in solar energy and boosts\nit internally.',NULL,'Regal Pokémon'),(498,'tepig',5,'It loves to eat roasted berries, but sometimes it\ngets too excited and burns them to a crisp.',NULL,'Fire Pig Pokémon'),(499,'pignite',5,'When its internal fire flares up, its movements grow\nsharper and faster. When in trouble, it emits smoke.',NULL,'Fire Pig Pokémon'),(500,'emboar',5,'It has mastered fast and powerful fighting moves.\nIt grows a beard of fire.',NULL,'Mega Fire Pig Pokémon'),(501,'oshawott',5,'It fights using the scalchop on its stomach.\nIn response to an attack, it retaliates immediately\nby slashing.',NULL,'Sea Otter Pokémon'),(502,'dewott',5,'As a result of strict training, each Dewott learns\ndifferent forms for using the scalchops.',NULL,'Discipline Pokémon'),(503,'samurott',5,'One swing of the sword incorporated in its armor\ncan fell an opponent. A simple glare from one of\nthem quiets everybody.',NULL,'Formidable Pokémon'),(504,'patrat',5,'Extremely cautious, one of them will always be on\nthe lookout, but it won’t notice a foe coming\nfrom behind.',NULL,'Scout Pokémon'),(505,'watchog',5,'When they see an enemy, their tails stand high,\nand they spit the seeds of berries stored in their\ncheek pouches.',NULL,'Lookout Pokémon'),(506,'lillipup',5,'This Pokémon is courageous but also cautious.\nIt uses the soft fur covering its face to collect\ninformation about its surroundings.',NULL,'Puppy Pokémon'),(507,'herdier',5,'Herdier is a very smart and friendly Pokémon.\nSo much so that there’s a theory that Herdier was\nthe first Pokémon to partner with people.',NULL,'Loyal Dog Pokémon'),(508,'stoutland',5,'These Pokémon seem to enjoy living with humans.\nEven a Stoutland caught in the wild will warm up\nto people in about three days.',NULL,'Big-Hearted Pokémon'),(509,'purrloin',5,'It steals things from people just to amuse itself\nwith their frustration. A rivalry exists between\nthis Pokémon and Nickit.',NULL,'Devious Pokémon'),(510,'liepard',5,'Don’t be fooled by its gorgeous fur and elegant\nfigure. This is a moody and vicious Pokémon.',NULL,'Cruel Pokémon'),(511,'pansage',5,'It’s good at finding berries and gathers them from\nall over. It’s kind enough to share them\nwith friends.',NULL,'Grass Monkey Pokémon'),(512,'simisage',5,'Ill tempered, it fights by swinging its barbed tail\naround wildly. The leaf growing on its head is\nvery bitter.',NULL,'Thorn Monkey Pokémon'),(513,'pansear',5,'This Pokémon lives in caves in volcanoes.\nThe fire within the tuft on its head can reach\n600 degrees Fahrenheit.',NULL,'High Temp Pokémon'),(514,'simisear',5,'When it gets excited, embers rise from its head\nand tail and it gets hot. For some reason, it\nloves sweets.',NULL,'Ember Pokémon'),(515,'panpour',5,'The water stored inside the tuft on its head is full of\nnutrients. Plants that receive its water grow large.',NULL,'Spray Pokémon'),(516,'simipour',5,'It prefers places with clean water. When its tuft runs\nlow, it replenishes it by siphoning up water with\nits tail.',NULL,'Geyser Pokémon'),(517,'munna',5,'Late at night, it appears beside people’s pillows.\nAs it feeds on dreams, the patterns on its body\ngive off a faint glow.',NULL,'Dream Eater Pokémon'),(518,'musharna',5,'When dark mists emanate from its body, don’t\nget too near. If you do, your nightmares will\nbecome reality.',NULL,'Drowsing Pokémon'),(519,'pidove',5,'Where people go, these Pokémon follow.\nIf you’re scattering food for them, be careful—\nseveral hundred of them can gather at once.',NULL,'Tiny Pigeon Pokémon'),(520,'tranquill',5,'It can fly moderately quickly. No matter how far\nit travels, it can always find its way back to its\nmaster and its nest.',NULL,'Wild Pigeon Pokémon'),(521,'unfezant',5,'Unfezant are exceptional fliers. The females\nare known for their stamina, while the males\noutclass them in terms of speed.',NULL,'Proud Pokémon'),(522,'blitzle',5,'Its mane shines when it discharges electricity.\nThey use the frequency and rhythm of these flashes\nto communicate.',NULL,'Electrified Pokémon'),(523,'zebstrika',5,'They have lightning-like movements.\nWhen Zebstrika run at full speed, the sound of\nthunder reverberates.',NULL,'Thunderbolt Pokémon'),(524,'roggenrola',5,'It’s as hard as steel, but apparently a long soak in\nwater will cause it to soften a bit.',NULL,'Mantle Pokémon'),(525,'boldore',5,'If you see its orange crystals start to glow, be\nwary. It’s about to fire off bursts of energy.',NULL,'Ore Pokémon'),(526,'gigalith',5,'This hardy Pokémon can often be found on\nconstruction sites and in mines, working\nalongside people and Copperajah.',NULL,'Compressed Pokémon'),(527,'woobat',5,'While inside a cave, if you look up and see lots\nof heart-shaped marks lining the walls, it’s\nevidence that Woobat live there.',NULL,'Bat Pokémon'),(528,'swoobat',5,'Emitting powerful sound waves tires it out.\nAfterward, it won’t be able to fly for a\nlittle while.',NULL,'Courting Pokémon'),(529,'drilbur',5,'It brings its claws together and whirls around at\nhigh speed before rushing toward its prey.',NULL,'Mole Pokémon'),(530,'excadrill',5,'It’s not uncommon for tunnels that appear to\nhave formed naturally to actually be a result\nof Excadrill’s rampant digging.',NULL,'Subterrene Pokémon'),(531,'audino',5,'Audino’s sense of hearing is superb. Not even a\npebble rolling along over a mile away will escape\nAudino’s ears.',NULL,'Hearing Pokémon'),(532,'timburr',5,'It loves helping out with construction projects.\nIt loves it so much that if rain causes work to halt,\nit swings its log around and throws a tantrum.',NULL,'Muscular Pokémon'),(533,'gurdurr',5,'It shows off its muscles to Machoke and other\nGurdurr. If it fails to measure up to the other\nPokémon, it lies low for a little while.',NULL,'Muscular Pokémon'),(534,'conkeldurr',5,'Concrete mixed by Conkeldurr is much more\ndurable than normal concrete, even when the\ncompositions of the two materials are the same.',NULL,'Muscular Pokémon'),(535,'tympole',5,'Graceful ripples running across the water’s\nsurface are a sure sign that Tympole are singing\nin high-pitched voices below.',NULL,'Tadpole Pokémon'),(536,'palpitoad',5,'It weakens its prey with sound waves intense\nenough to cause headaches, then entangles\nthem with its sticky tongue.',NULL,'Vibration Pokémon'),(537,'seismitoad',5,'The vibrating of the bumps all over its body\ncauses earthquake-like tremors. Seismitoad and\nCroagunk are similar species.',NULL,'Vibration Pokémon'),(538,'throh',5,'It performs throwing moves with first-rate skill.\nOver the course of many battles, Throh’s belt\ngrows darker as it absorbs its wearer’s sweat.',NULL,'Judo Pokémon'),(539,'sawk',5,'If you see a Sawk training in the mountains in its\nsingle-minded pursuit of strength, it’s best to\nquietly pass by.',NULL,'Karate Pokémon'),(540,'sewaddle',5,'Since this Pokémon makes its own clothes out of\nleaves, it is a popular mascot for fashion designers.',NULL,'Sewing Pokémon'),(541,'swadloon',5,'It protects itself from the cold by wrapping up in\nleaves. It stays on the move, eating leaves\nin forests.',NULL,'Leaf-Wrapped Pokémon'),(542,'leavanny',5,'It keeps its eggs warm with heat from fermenting\nleaves. It also uses leaves to make warm wrappings\nfor Sewaddle.',NULL,'Nurturing Pokémon'),(543,'venipede',5,'Venipede and Sizzlipede are similar species,\nbut when the two meet, a huge fight ensues.',NULL,'Centipede Pokémon'),(544,'whirlipede',5,'This Pokémon spins itself rapidly and charges into\nits opponents. Its top speed is just over 60 mph.',NULL,'Curlipede Pokémon'),(545,'scolipede',5,'Scolipede latches on to its prey with the claws on\nits neck before slamming them into the ground\nand jabbing them with its claws’ toxic spikes.',NULL,'Megapede Pokémon'),(546,'cottonee',5,'It shoots cotton from its body to protect itself.\nIf it gets caught up in hurricane-strength winds,\nit can get sent to the other side of the Earth.',NULL,'Cotton Puff Pokémon'),(547,'whimsicott',5,'It scatters cotton all over the place as a prank. If\nit gets wet, it’ll become too heavy to move and\nhave no choice but to answer for its mischief.',NULL,'Windveiled Pokémon'),(548,'petilil',5,'Petilil appears around sources of clean water.\nBoiling leaves from this Pokémon’s head results in\na liquid that’s sometimes used as a bug repellent.',NULL,'Bulb Pokémon'),(549,'lilligant',5,'It’s believed that even first-rate gardeners have a\nhard time getting the flower on a Lilligant’s head\nto bloom.',NULL,'Flowering Pokémon'),(550,'basculin',5,'Anglers love the fight this Pokémon puts up on\nthe hook. And there are always more to catch—\nmany people release them into lakes illicitly.',NULL,'Hostile Pokémon'),(551,'sandile',5,'The desert gets cold at night, so when the sun\nsets, this Pokémon burrows deep into the sand\nand sleeps until sunrise.',NULL,'Desert Croc Pokémon'),(552,'krokorok',5,'Krokorok has specialized eyes that enable it to\nsee in the dark. This ability lets Krokorok hunt in\nthe dead of night without getting lost.',NULL,'Desert Croc Pokémon'),(553,'krookodile',5,'This Pokémon is known as the Bully of the Sands.\nKrookodile’s mighty jaws can bite through heavy\nplates of iron with almost no effort at all.',NULL,'Intimidation Pokémon'),(554,'darumaka',5,'It derives its power from fire burning inside\nits body. If the fire dwindles, this Pokémon will\nimmediately fall asleep.',NULL,'Zen Charm Pokémon'),(555,'darmanitan',5,'The thick arms of this hot-blooded Pokémon\ncan deliver punches capable of obliterating a\ndump truck.',NULL,'Blazing Pokémon'),(556,'maractus',5,'With noises that could be mistaken for the rattles\nof maracas, it creates an upbeat rhythm, startling\nbird Pokémon and making them fly off in a hurry.',NULL,'Cactus Pokémon'),(557,'dwebble',5,'When it finds a stone appealing, it creates a hole\ninside it and uses it as its home. This Pokémon is\nthe natural enemy of Roggenrola and Rolycoly.',NULL,'Rock Inn Pokémon'),(558,'crustle',5,'This highly territorial Pokémon prefers dry\nclimates. It won’t come out of its boulder on\nrainy days.',NULL,'Stone Home Pokémon'),(559,'scraggy',5,'If it locks eyes with you, watch out! Nothing and\nno one is safe from the reckless headbutts of this\ntroublesome Pokémon.',NULL,'Shedding Pokémon'),(560,'scrafty',5,'As halfhearted as this Pokémon’s kicks may seem,\nthey pack enough power to shatter Conkeldurr’s\nconcrete pillars.',NULL,'Hoodlum Pokémon'),(561,'sigilyph',5,'Psychic power allows these Pokémon to fly. Some\nsay they were the guardians of an ancient city.\nOthers say they were the guardians’ emissaries.',NULL,'Avianoid Pokémon'),(562,'yamask',5,'It wanders through ruins by night, carrying a mask\nthat’s said to have been the face it had when it\nwas still human.',NULL,'Spirit Pokémon'),(563,'cofagrigus',5,'This Pokémon has a body of sparkling gold.\nPeople say it no longer remembers that it was\nonce human.',NULL,'Coffin Pokémon'),(564,'tirtouga',5,'This Pokémon inhabited ancient seas. Although\nit can only crawl, it still comes up onto land in\nsearch of prey.',NULL,'Prototurtle Pokémon'),(565,'carracosta',5,'Carracosta completely devours its prey—bones,\nshells, and all. Because of this, Carracosta’s own\nshell grows thick and sturdy.',NULL,'Prototurtle Pokémon'),(566,'archen',5,'This Pokémon was successfully restored from a\nfossil. As research suggested, Archen is unable\nto fly. But it’s very good at jumping.',NULL,'First Bird Pokémon'),(567,'archeops',5,'It needs a running start to take off. If Archeops\nwants to fly, it first needs to run nearly 25 mph,\nbuilding speed over a course of about 2.5 miles.',NULL,'First Bird Pokémon'),(568,'trubbish',5,'Its favorite places are unsanitary ones. If you\nleave trash lying around, you could even find\none of these Pokémon living in your room.',NULL,'Trash Bag Pokémon'),(569,'garbodor',5,'This Pokémon eats trash, which turns into poison\ninside its body. The main component of the\npoison depends on what sort of trash was eaten.',NULL,'Trash Heap Pokémon'),(570,'zorua',5,'Zorua is a timid Pokémon. This disposition seems\nto be what led to the development of Zorua’s\nability to take on the forms of other creatures.',NULL,'Tricky Fox Pokémon'),(571,'zoroark',5,'This Pokémon cares deeply about others of its\nkind, and it will conjure terrifying illusions to\nkeep its den and pack safe.',NULL,'Illusion Fox Pokémon'),(572,'minccino',5,'The way it brushes away grime with its tail\ncan be helpful when cleaning. But its focus on\nspotlessness can make cleaning more of a hassle.',NULL,'Chinchilla Pokémon'),(573,'cinccino',5,'Its body secretes oil that this Pokémon spreads\nover its nest as a coating to protect it from dust.\nCinccino won’t tolerate even a speck of the stuff.',NULL,'Scarf Pokémon'),(574,'gothita',5,'Though they’re still only babies, there’s psychic\npower stored in their ribbonlike feelers, and\nsometimes they use that power to fight.',NULL,'Fixation Pokémon'),(575,'gothorita',5,'It’s said that when stars shine in the night sky,\nthis Pokémon will spirit away sleeping children.\nSome call it the Witch of Punishment.',NULL,'Manipulate Pokémon'),(576,'gothitelle',5,'It has tremendous psychic power, but it dislikes\nconflict. It’s also able to predict the future based\non the movement of the stars.',NULL,'Astral Body Pokémon'),(577,'solosis',5,'It communicates with others telepathically.\nIts body is encapsulated in liquid, but if it takes\na heavy blow, the liquid will leak out.',NULL,'Cell Pokémon'),(578,'duosion',5,'Its psychic power can supposedly cover a range\nof more than half a mile—but only if its two\nbrains can agree with each other.',NULL,'Mitosis Pokémon'),(579,'reuniclus',5,'While it could use its psychic abilities in battle,\nthis Pokémon prefers to swing its powerful arms\naround to beat opponents into submission.',NULL,'Multiplying Pokémon'),(580,'ducklett',5,'They are better at swimming than flying, and they\nhappily eat their favorite food, peat moss, as they\ndive underwater.',NULL,'Water Bird Pokémon'),(581,'swanna',5,'Swanna start to dance at dusk. The one dancing in\nthe middle is the leader of the flock.',NULL,'White Bird Pokémon'),(582,'vanillite',5,'Unable to survive in hot areas, it makes itself\ncomfortable by breathing out air cold enough to\ncause snow. It burrows into the snow to sleep.',NULL,'Fresh Snow Pokémon'),(583,'vanillish',5,'By drinking pure water, it grows its icy body.\nThis Pokémon can be hard to find on days with\nwarm, sunny weather.',NULL,'Icy Snow Pokémon'),(584,'vanilluxe',5,'When its anger reaches a breaking point, this\nPokémon unleashes a fierce blizzard that freezes\nevery creature around it, be they friend or foe.',NULL,'Snowstorm Pokémon'),(585,'deerling',5,'The turning of the seasons changes the color and\nscent of this Pokémon’s fur. People use it to mark\nthe seasons.',NULL,'Season Pokémon'),(586,'sawsbuck',5,'They migrate according to the seasons, so some\npeople call Sawsbuck the harbingers of spring.',NULL,'Season Pokémon'),(587,'emolga',5,'As Emolga flutters through the air, it crackles\nwith electricity. This Pokémon is cute, but it can\ncause a lot of trouble.',NULL,'Sky Squirrel Pokémon'),(588,'karrablast',5,'Its strange physiology reacts to electrical energy\nin interesting ways. The presence of a Shelmet\nwill cause this Pokémon to evolve.',NULL,'Clamping Pokémon'),(589,'escavalier',5,'They use shells they’ve stolen from Shelmet\nto arm and protect themselves. They’re very\npopular Pokémon in the Galar region.',NULL,'Cavalry Pokémon'),(590,'foongus',5,'No one knows what the Poké Ball–like pattern on\nFoongus means or why Foongus has it.',NULL,'Mushroom Pokémon'),(591,'amoonguss',5,'This Pokémon puffs poisonous spores at its foes.\nIf the spores aren’t washed off quickly, they’ll\ngrow into mushrooms wherever they land.',NULL,'Mushroom Pokémon'),(592,'frillish',5,'It envelops its prey in its veillike arms and draws\nit down to the deeps, five miles below the\nocean’s surface.',NULL,'Floating Pokémon'),(593,'jellicent',5,'Most of this Pokémon’s body composition is\nidentical to sea water. It makes sunken ships\nits lair.',NULL,'Floating Pokémon'),(594,'alomomola',5,'It gently holds injured and weak Pokémon in its\nfins. Its special membrane heals their wounds.',NULL,'Caring Pokémon'),(595,'joltik',5,'Joltik can be found clinging to other Pokémon.\nIt’s soaking up static electricity because it can’t\nproduce a charge on its own.',NULL,'Attaching Pokémon'),(596,'galvantula',5,'It launches electrified fur from its abdomen as its\nmeans of attack. Opponents hit by the fur could\nbe in for three full days and nights of paralysis.',NULL,'EleSpider Pokémon'),(597,'ferroseed',5,'It defends itself by launching spikes, but its\naim isn’t very good at first. Only after a lot of\npractice will it improve.',NULL,'Thorn Seed Pokémon'),(598,'ferrothorn',5,'This Pokémon scrapes its spikes across rocks,\nand then uses the tips of its feelers to absorb\nthe nutrients it finds within the stone.',NULL,'Thorn Pod Pokémon'),(599,'klink',5,'The two minigears that compose this Pokémon\nare closer than twins. They mesh well only with\neach other.',NULL,'Gear Pokémon'),(600,'klang',5,'When Klang goes all out, the minigear links up\nperfectly with the outer part of the big gear, and\nthis Pokémon’s rotation speed increases sharply.',NULL,'Gear Pokémon'),(601,'klinklang',5,'From its spikes, it launches powerful blasts of\nelectricity. Its red core contains an enormous\namount of energy.',NULL,'Gear Pokémon'),(602,'tynamo',5,'One alone can emit only a trickle of electricity,\nso a group of them gathers to unleash a powerful\nelectric shock.',NULL,'EleFish Pokémon'),(603,'eelektrik',5,'These Pokémon have a big appetite. When they\nspot their prey, they attack it and paralyze it\nwith electricity.',NULL,'EleFish Pokémon'),(604,'eelektross',5,'They crawl out of the ocean using their arms.\nThey will attack prey on shore and immediately drag\nit into the ocean.',NULL,'EleFish Pokémon'),(605,'elgyem',5,'If this Pokémon stands near a TV, strange scenery\nwill appear on the screen. That scenery is said\nto be from its home.',NULL,'Cerebral Pokémon'),(606,'beheeyem',5,'Whenever a Beheeyem visits a farm,\na Dubwool mysteriously disappears.',NULL,'Cerebral Pokémon'),(607,'litwick',5,'The flame on its head keeps its body slightly\nwarm. This Pokémon takes lost children by the\nhand to guide them to the spirit world.',NULL,'Candle Pokémon'),(608,'lampent',5,'This Pokémon appears just before someone\npasses away, so it’s feared as an emissary\nof death.',NULL,'Lamp Pokémon'),(609,'chandelure',5,'This Pokémon haunts dilapidated mansions.\nIt sways its arms to hypnotize opponents with\nthe ominous dancing of its flames.',NULL,'Luring Pokémon'),(610,'axew',5,'These Pokémon nest in the ground and use their\ntusks to crush hard berries. Crushing berries is\nalso how they test each other’s strength.',NULL,'Tusk Pokémon'),(611,'fraxure',5,'After battle, this Pokémon carefully sharpens its\ntusks on river rocks. It needs to take care of its\ntusks—if one breaks, it will never grow back.',NULL,'Axe Jaw Pokémon'),(612,'haxorus',5,'Its resilient tusks are its pride and joy. It licks up\ndirt to take in the minerals it needs to keep its\ntusks in top condition.',NULL,'Axe Jaw Pokémon'),(613,'cubchoo',5,'When this Pokémon is in good health, its snot\nbecomes thicker and stickier. It will smear its snot\non anyone it doesn’t like.',NULL,'Chill Pokémon'),(614,'beartic',5,'It swims through frigid seas, searching for prey.\nFrom its frozen breath, it forms icy fangs that\nare harder than steel.',NULL,'Freezing Pokémon'),(615,'cryogonal',5,'With its icy chains, Cryogonal freezes those it\nencounters. It then takes its victims away to\nsomewhere unknown.',NULL,'Crystallizing Pokémon'),(616,'shelmet',5,'When attacked, it tightly shuts the lid of its shell.\nThis reaction fails to protect it from Karrablast,\nhowever, because they can still get into the shell.',NULL,'Snail Pokémon'),(617,'accelgor',5,'It moves with blinding speed and lobs poison at\nfoes. Featuring Accelgor as a main character is\na surefire way to make a movie or comic popular.',NULL,'Shell Out Pokémon'),(618,'stunfisk',5,'Thanks to bacteria that lived in the mud flats with\nit, this Pokémon developed the organs it uses to\ngenerate electricity.',NULL,'Trap Pokémon'),(619,'mienfoo',5,'In one minute, a well-trained Mienfoo can chop\nwith its arms more than 100 times.',NULL,'Martial Arts Pokémon'),(620,'mienshao',5,'When Mienshao comes across a truly challenging\nopponent, it will lighten itself by biting off the\nfur on its arms.',NULL,'Martial Arts Pokémon'),(621,'druddigon',5,'Druddigon lives in caves, but it never skips\nsunbathing—it won’t be able to move if its body\ngets too cold.',NULL,'Cave Pokémon'),(622,'golett',5,'They were sculpted from clay in ancient times.\nNo one knows why, but some of them are driven\nto continually line up boulders.',NULL,'Automaton Pokémon'),(623,'golurk',5,'Artillery platforms built into the walls of ancient\ncastles served as perches from which Golurk\ncould fire energy beams.',NULL,'Automaton Pokémon'),(624,'pawniard',5,'It uses river stones to maintain the cutting edges\nof the blades covering its body. These sharpened\nblades allow it to bring down opponents.',NULL,'Sharp Blade Pokémon'),(625,'bisharp',5,'It’s accompanied by a large retinue of Pawniard.\nBisharp keeps a keen eye on its minions, ensuring\nnone of them even think of double-crossing it.',NULL,'Sword Blade Pokémon'),(626,'bouffalant',5,'These Pokémon can crush a car with no more\nthan a headbutt. Bouffalant with more hair on\ntheir heads hold higher positions within the herd.',NULL,'Bash Buffalo Pokémon'),(627,'rufflet',5,'If it spies a strong Pokémon, Rufflet can’t resist\nchallenging it to a battle. But if Rufflet loses,\nit starts bawling.',NULL,'Eaglet Pokémon'),(628,'braviary',5,'Known for its bravery and pride, this majestic\nPokémon is often seen as a motif for various\nkinds of emblems.',NULL,'Valiant Pokémon'),(629,'vullaby',5,'It wears a bone to protect its rear.\nIt often squabbles with others of its kind over\nparticularly comfy bones.',NULL,'Diapered Pokémon'),(630,'mandibuzz',5,'Although it’s a bit of a ruffian, this Pokémon will\ntake lost Vullaby under its wing and care for them\ntill they’re ready to leave the nest.',NULL,'Bone Vulture Pokémon'),(631,'heatmor',5,'There’s a hole in its tail that allows it to draw in\nthe air it needs to keep its fire burning. If the\nhole gets blocked, this Pokémon will fall ill.',NULL,'Anteater Pokémon'),(632,'durant',5,'They lay their eggs deep inside their nests.\nWhen attacked by Heatmor, they retaliate\nusing their massive mandibles.',NULL,'Iron Ant Pokémon'),(633,'deino',5,'When it encounters something, its first urge is\nusually to bite it. If it likes what it tastes, it will\ncommit the associated scent to memory.',NULL,'Irate Pokémon'),(634,'zweilous',5,'While hunting for prey, Zweilous wanders its\nterritory, its two heads often bickering over\nwhich way to go.',NULL,'Hostile Pokémon'),(635,'hydreigon',5,'There are a slew of stories about villages that\nwere destroyed by Hydreigon. It bites anything\nthat moves.',NULL,'Brutal Pokémon'),(636,'larvesta',5,'The people of ancient times believed that\nLarvesta fell from the sun.',NULL,'Torch Pokémon'),(637,'volcarona',5,'Volcarona scatters burning scales. Some say it\ndoes this to start fires. Others say it’s trying to\nrescue those that suffer in the cold.',NULL,'Sun Pokémon'),(638,'cobalion',5,'This Pokémon appears in a legend alongside\nTerrakion and Virizion, fighting against humans in\ndefense of the Unova region’s Pokémon.',NULL,'Iron Will Pokémon'),(639,'terrakion',5,'It has phenomenal power. It will mercilessly crush\nanyone or anything that bullies small Pokémon.',NULL,'Cavern Pokémon'),(640,'virizion',5,'A legend tells of this Pokémon working\ntogether with Cobalion and Terrakion to\nprotect the Pokémon of the Unova region.',NULL,'Grassland Pokémon'),(641,'tornadus',5,'Tornadus expels massive energy from its tail,\ncausing severe storms. Its power is great enough\nto blow houses away.',NULL,'Cyclone Pokémon'),(642,'thundurus',5,'As it flies around, it shoots lightning all over\nthe place and causes forest fires. It is\ntherefore disliked.',NULL,'Bolt Strike Pokémon'),(643,'reshiram',5,'Flames spew from its tail as it flies through the\nsky like a jet airplane. It’s said that this Pokémon\nwill scorch the world.',NULL,'Vast White Pokémon'),(644,'zekrom',5,'When the interior part of its tail spins like a\nmotor, Zekrom can generate many bolts of\nlightning to blast its surroundings.',NULL,'Deep Black Pokémon'),(645,'landorus',5,'From the forces of lightning and wind, it creates\nenergy to give nutrients to the soil and make the\nland abundant.',NULL,'Abundance Pokémon'),(646,'kyurem',5,'Dwelling within it is a power even greater than\nthat of Reshiram or Zekrom, but the extreme\ncold keeps that power bound.',NULL,'Boundary Pokémon'),(647,'keldeo',5,'Cobalion, Terrakion, and Virizion taught this\nPokémon how to fight. It dashes across the world,\nseeking more opportunities to further its training.',NULL,'Colt Pokémon'),(648,'meloetta',5,'Its melodies are sung with a special vocalization\nmethod that can control the feelings of those who\nhear it.',NULL,'Melody Pokémon'),(649,'genesect',5,'This Pokémon existed 300 million years ago. Team\nPlasma altered it and attached a cannon to its back.',NULL,'Paleozoic Pokémon'),(650,'chespin',6,'Such a thick shell of wood covers its head and back\nthat even a direct hit from a truck wouldn’t faze it.',NULL,'Spiny Nut Pokémon'),(651,'quilladin',6,'They strengthen their lower bodies by\nrunning into one another. They are very\nkind and won’t start fights.',NULL,'Spiny Armor Pokémon'),(652,'chesnaught',6,'When it takes a defensive posture with its fists\nguarding its face, it could withstand a bomb blast.',NULL,'Spiny Armor Pokémon'),(653,'fennekin',6,'As it walks, it munches on a twig in place\nof a snack. It intimidates opponents\nby puffing hot air out of its ears.',NULL,'Fox Pokémon'),(654,'braixen',6,'When the twig is plucked from its tail,\nfriction sets the twig alight. The flame\nis used to send signals to its allies.',NULL,'Fox Pokémon'),(655,'delphox',6,'Using psychic power, it generates a\nfiery vortex of 5,400 degrees Fahrenheit,\nincinerating foes swept into this whirl of flame.',NULL,'Fox Pokémon'),(656,'froakie',6,'It protects its skin by covering its body in\ndelicate bubbles. Beneath its happy-go-lucky air,\nit keeps a watchful eye on its surroundings.',NULL,'Bubble Frog Pokémon'),(657,'frogadier',6,'Its swiftness is unparalleled.\nIt can scale a tower of more\nthan 2,000 feet in a minute’s time.',NULL,'Bubble Frog Pokémon'),(658,'greninja',6,'It appears and vanishes with a ninja’s grace.\nIt toys with its enemies using swift movements, while\nslicing them with throwing stars of sharpest water.',NULL,'Ninja Pokémon'),(659,'bunnelby',6,'It excels at digging holes. Using its ears, it can\ndig a nest 33 feet deep in one night.',NULL,'Digging Pokémon'),(660,'diggersby',6,'With power equal to an excavator, it can dig\nthrough dense bedrock. It’s a huge help during\ntunnel construction.',NULL,'Digging Pokémon'),(661,'fletchling',6,'Its melodious cries are actually warnings.\nFletchling will mercilessly peck at anything\nthat enters its territory.',NULL,'Tiny Robin Pokémon'),(662,'fletchinder',6,'Fletchinder launches embers into the den of\nits prey. When the prey comes leaping out,\nFletchinder’s sharp talons finish it off.',NULL,'Ember Pokémon'),(663,'talonflame',6,'Talonflame mainly preys upon other bird\nPokémon. To intimidate opponents, it sends\nembers spewing from gaps between its feathers.',NULL,'Scorching Pokémon'),(664,'scatterbug',6,'The powder that covers its body\nregulates its temperature, so it\ncan live in any region or climate.',NULL,'Scatterdust Pokémon'),(665,'spewpa',6,'The beaks of bird Pokémon can’t begin\nto scratch its stalwart body.\nTo defend itself, it spews powder.',NULL,'Scatterdust Pokémon'),(666,'vivillon',6,'The patterns on this Pokémon’s wings\ndepend on the climate and topography\nof its habitat. It scatters colorful scales.',NULL,'Scale Pokémon'),(667,'litleo',6,'They set off on their own from their pride\nand live by themselves to become stronger.\nThese hot-blooded Pokémon are quick to fight.',NULL,'Lion Cub Pokémon'),(668,'pyroar',6,'With fiery breath of more than 10,000 degrees\nFahrenheit, they viciously threaten any challenger.\nThe females protect the pride’s cubs.',NULL,'Royal Pokémon'),(669,'flabebe',6,'When it finds a flower it likes, it dwells on\nthat flower its whole life long. It floats in the\nwind’s embrace with an untroubled heart.',NULL,'Single Bloom Pokémon'),(670,'floette',6,'When the flowers of a well-tended flower bed bloom,\nit appears and celebrates with an elegant dance.',NULL,'Single Bloom Pokémon'),(671,'florges',6,'In times long past, governors of castles\nwould invite Florges to create flower gardens\nto embellish the castle domains.',NULL,'Garden Pokémon'),(672,'skiddo',6,'If it has sunshine and water, it doesn’t\nneed to eat, because it can generate\nenergy from the leaves on its back.',NULL,'Mount Pokémon'),(673,'gogoat',6,'They inhabit mountainous regions.\nThe leader of the herd is decided by\na battle of clashing horns.',NULL,'Mount Pokémon'),(674,'pancham',6,'It chooses a Pangoro as its master and then\nimitates its master’s actions. This is how it learns\nto battle and hunt for prey.',NULL,'Playful Pokémon'),(675,'pangoro',6,'This Pokémon is quick to anger, and it has no\nproblem using its prodigious strength to get its\nway. It lives for duels against Obstagoon.',NULL,'Daunting Pokémon'),(676,'furfrou',6,'Historically, in the Kalos region, these Pokémon\nwere the designated guardians of the king.',NULL,'Poodle Pokémon'),(677,'espurr',6,'Though Espurr’s expression never changes,\nbehind that blank stare is an intense struggle to\ncontain its devastating psychic power.',NULL,'Restraint Pokémon'),(678,'meowstic',6,'Revealing the eyelike patterns on the insides of\nits ears will unleash its psychic powers. It normally\nkeeps the patterns hidden, however.',NULL,'Constraint Pokémon'),(679,'honedge',6,'Honedge’s soul once belonged to a person who\nwas killed a long time ago by the sword that\nmakes up Honedge’s body.',NULL,'Sword Pokémon'),(680,'doublade',6,'Honedge evolves into twins. The two blades\nrub together to emit a metallic sound that\nunnerves opponents.',NULL,'Sword Pokémon'),(681,'aegislash',6,'In this defensive stance, Aegislash uses its steel\nbody and a force field of spectral power to\nreduce the damage of any attack.',NULL,'Royal Sword Pokémon'),(682,'spritzee',6,'A scent pouch within this Pokémon’s body allows\nit to create various scents. A change in its diet\nwill alter the fragrance it produces.',NULL,'Perfume Pokémon'),(683,'aromatisse',6,'The scent that constantly emits from its fur is so\npowerful that this Pokémon’s companions will\neventually lose their sense of smell.',NULL,'Fragrance Pokémon'),(684,'swirlix',6,'It eats its own weight in sugar every day.\nIf it doesn’t get enough sugar, it becomes\nincredibly grumpy.',NULL,'Cotton Candy Pokémon'),(685,'slurpuff',6,'By taking in a person’s scent, it can sniff out their\nmental and physical condition. It’s hoped that\nthis skill will have many medical applications.',NULL,'Meringue Pokémon'),(686,'inkay',6,'It spins while making its luminescent spots flash.\nThese spots allow it to communicate with others\nby using different patterns of light.',NULL,'Revolving Pokémon'),(687,'malamar',6,'Gazing at its luminescent spots will quickly\ninduce a hypnotic state, putting the observer\nunder Malamar’s control.',NULL,'Overturning Pokémon'),(688,'binacle',6,'After two Binacle find a suitably sized rock, they\nadhere themselves to it and live together.\nThey cooperate to gather food during high tide.',NULL,'Two-Handed Pokémon'),(689,'barbaracle',6,'Seven Binacle come together to form one\nBarbaracle. The Binacle that serves as the head\ngives orders to those serving as the limbs.',NULL,'Collective Pokémon'),(690,'skrelp',6,'It drifts in the ocean, blending in with floating\nseaweed. When other Pokémon come to feast on\nthe seaweed, Skrelp feasts on them instead.',NULL,'Mock Kelp Pokémon'),(691,'dragalge',6,'Dragalge uses a poisonous liquid capable of\ncorroding metal to send tankers that enter its\nterritory to the bottom of the sea.',NULL,'Mock Kelp Pokémon'),(692,'clauncher',6,'Clauncher’s claws can fall off during battle, but\nthey’ll regenerate. The meat inside the claws is\npopular as a delicacy in Galar.',NULL,'Water Gun Pokémon'),(693,'clawitzer',6,'After using the feelers on its oversized claw to\ndetect the location of prey, Clawitzer launches\na cannonball of water at its target.',NULL,'Howitzer Pokémon'),(694,'helioptile',6,'When spread, the frills on its head act like solar\npanels, generating the power behind this\nPokémon’s electric moves.',NULL,'Generator Pokémon'),(695,'heliolisk',6,'A now-vanished desert culture treasured these\nPokémon. Appropriately, when Heliolisk came to\nthe Galar region, treasure came with them.',NULL,'Generator Pokémon'),(696,'tyrunt',6,'This is an ancient Pokémon, revived in modern\ntimes. It has a violent disposition, and it’ll tear\napart anything it gets between its hefty jaws.',NULL,'Royal Heir Pokémon'),(697,'tyrantrum',6,'This Pokémon is from about 100,000,000\nyears ago. It has the presence of a king, vicious\nbut magnificent.',NULL,'Despot Pokémon'),(698,'amaura',6,'This Pokémon was successfully restored from a\nfossil. In the past, it lived with others of its kind\nin cold lands where there were fewer predators.',NULL,'Tundra Pokémon'),(699,'aurorus',6,'Aurorus was restored from a fossil. It’s said that\nwhen this Pokémon howls, auroras appear in the\nnight sky.',NULL,'Tundra Pokémon'),(700,'sylveon',6,'By releasing enmity-erasing waves from its\nribbonlike feelers, Sylveon stops any conflict.',NULL,'Intertwining Pokémon'),(701,'hawlucha',6,'It drives its opponents to exhaustion with its agile\nmaneuvers, then ends the fight with a flashy\nfinishing move.',NULL,'Wrestling Pokémon'),(702,'dedenne',6,'A Dedenne’s whiskers pick up electrical waves\nother Dedenne send out. These Pokémon share\nlocations of food or electricity with one another.',NULL,'Antenna Pokémon'),(703,'carbink',6,'When beset by attackers, Carbink wipes them all\nout by firing high-energy beams from the gems\nembedded in its body.',NULL,'Jewel Pokémon'),(704,'goomy',6,'Because most of its body is water, it will dry up if\nthe weather becomes too arid. It’s considered\nthe weakest dragon Pokémon.',NULL,'Soft Tissue Pokémon'),(705,'sliggoo',6,'Although this Pokémon isn’t very strong, its body\nis coated in a caustic slime that can melt through\nanything, so predators steer clear of it.',NULL,'Soft Tissue Pokémon'),(706,'goodra',6,'Sometimes it misunderstands instructions and\nappears dazed or bewildered. Many Trainers\ndon’t mind, finding this behavior to be adorable.',NULL,'Dragon Pokémon'),(707,'klefki',6,'This Pokémon is constantly collecting keys.\nEntrust a Klefki with important keys, and the\nPokémon will protect them no matter what.',NULL,'Key Ring Pokémon'),(708,'phantump',6,'After a lost child perished in the forest, their\nspirit possessed a tree stump, causing the spirit’s\nrebirth as this Pokémon.',NULL,'Stump Pokémon'),(709,'trevenant',6,'People fear it due to a belief that it devours any\nwho try to cut down trees in its forest, but to the\nPokémon it shares its woods with, it’s kind.',NULL,'Elder Tree Pokémon'),(710,'pumpkaboo',6,'Spirits that wander this world are placed into\nPumpkaboo’s body. They’re then moved on to\nthe afterlife.',NULL,'Pumpkin Pokémon'),(711,'gourgeist',6,'Eerie cries emanate from its body in the dead of\nnight. The sounds are said to be the wails of\nspirits who are suffering in the afterlife.',NULL,'Pumpkin Pokémon'),(712,'bergmite',6,'They chill the air around them to −150 degrees\nFahrenheit, freezing the water in the air into ice\nthat they use as armor.',NULL,'Ice Chunk Pokémon'),(713,'avalugg',6,'At high latitudes, this Pokémon can be found\nwith clusters of Bergmite on its back as it swims\namong the icebergs.',NULL,'Iceberg Pokémon'),(714,'noibat',6,'After nightfall, they emerge from the caves they\nnest in during the day. Using their ultrasonic\nwaves, they go on the hunt for ripened fruit.',NULL,'Sound Wave Pokémon'),(715,'noivern',6,'Aggressive and cruel, this Pokémon will ruthlessly\ntorment enemies that are helpless in the dark.',NULL,'Sound Wave Pokémon'),(716,'xerneas',6,'When the horns on its head shine\nin seven colors, it is said to be\nsharing everlasting life.',NULL,'Life Pokémon'),(717,'yveltal',6,'When its life comes to an end, it absorbs\nthe life energy of every living thing\nand turns into a cocoon once more.',NULL,'Destruction Pokémon'),(718,'zygarde',6,'It’s hypothesized that it’s monitoring\nthose who destroy the ecosystem\nfrom deep in the cave where it lives.',NULL,'Order Pokémon'),(719,'diancie',6,'It can instantly create many diamonds\nby compressing the carbon in the air\nbetween its hands.',NULL,'Jewel Pokémon'),(720,'hoopa',6,'It gathers things it likes and passes them through\nits loop to teleport them to a secret place.',NULL,'Mischief Pokémon'),(721,'volcanion',6,'It expels its internal steam from the\narms on its back. It has enough\npower to blow away a mountain.',NULL,'Steam Pokémon'),(722,'rowlet',7,'At a distance, it launches its sharp feathers while\nflying about. If the enemy gets too close, Rowlet\nswitches tactics and delivers vicious kicks.',NULL,'Grass Quill Pokémon'),(723,'dartrix',7,'It throws one knifelike feather after another at its\nenemies, and each one precisely strikes a weak\npoint. These feathers are known as blade quills.',NULL,'Blade Quill Pokémon'),(724,'decidueye',7,'As if wielding a bow, it launches the arrow quills\nhidden among the feathers of its wings.\nDecidueye’s shots never miss.',NULL,'Arrow Quill Pokémon'),(725,'litten',7,'It spends even the smallest amount of downtime\ngrooming its fur with its tongue. Loose fur gathers\nin its stomach and serves as fuel for fiery moves.',NULL,'Fire Cat Pokémon'),(726,'torracat',7,'In the midst of battle, the fire pouch on\nTorracat’s neck rings like a bell and produces\nstronger flames than usual.',NULL,'Fire Cat Pokémon'),(727,'incineroar',7,'It excels at violent, no-holds-barred battles.\nThe temperature of the flames that issue from its\nnavel exceeds 3,600 degrees Fahrenheit.',NULL,'Heel Pokémon'),(728,'popplio',7,'It creates special bouncy balloons to send at its\nopponents. When the balloons pop, the sheer\nforce of their bursting is what deals damage.',NULL,'Sea Lion Pokémon'),(729,'brionne',7,'As if dancing, it artfully dodges the attacks of its\nenemies. All the while, it’s busy forming a bunch\nof balloons to overwhelm its foes.',NULL,'Pop Star Pokémon'),(730,'primarina',7,'With its mouth, it makes sonic waves that sound\nlike beautiful singing. It uses the sonic waves to\ncontrol its water balloons.',NULL,'Soloist Pokémon'),(731,'pikipek',7,'It can peck at a rate of 16 times a second to\ndrill holes in trees. It uses the holes for food\nstorage and for nesting.',NULL,'Woodpecker Pokémon'),(732,'trumbeak',7,'It eats berries and stores their seeds in its\nbeak. When it encounters enemies or prey,\nit fires off all the seeds in a burst.',NULL,'Bugle Beak Pokémon'),(733,'toucannon',7,'When it battles, its beak heats up. The\ntemperature can easily exceed 212 degrees\nFahrenheit, causing severe burns when it hits.',NULL,'Cannon Pokémon'),(734,'yungoos',7,'With its sharp fangs, it will bite anything.\nIt did not originally live in Alola but was\nimported from another region.',NULL,'Loitering Pokémon'),(735,'gumshoos',7,'When it finds a trace of its prey, it patiently\nstakes out the location...but it’s always snoozing\nby nightfall.',NULL,'Stakeout Pokémon'),(736,'grubbin',7,'Its natural enemies, like Rookidee, may\nflee rather than risk getting caught in its large\nmandibles that can snap thick tree branches.',NULL,'Larva Pokémon'),(737,'charjabug',7,'While its durable shell protects it from attacks,\nCharjabug strikes at enemies with jolts of\nelectricity discharged from the tips of its jaws.',NULL,'Battery Pokémon'),(738,'vikavolt',7,'It builds up electricity in its abdomen, focuses it\nthrough its jaws, and then fires the electricity off\nin concentrated beams.',NULL,'Stag Beetle Pokémon'),(739,'crabrawler',7,'While guarding its weak points with its pincers,\nit looks for an opening and unleashes punches.\nWhen it loses, it foams at the mouth and faints.',NULL,'Boxing Pokémon'),(740,'crabominable',7,'It aimed for the top but got lost and ended up\non a snowy mountain. Being forced to endure\nthe cold, this Pokémon evolved and grew fur.',NULL,'Woolly Crab Pokémon'),(741,'oricorio',7,'It beats its wings together to create fire.\nAs it moves in the steps of its beautiful dance,\nit bathes opponents in intense flames.',NULL,'Dancing Pokémon'),(742,'cutiefly',7,'Nectar and pollen are its favorite fare. You can\nfind Cutiefly hovering around Gossifleur, trying\nto get some of Gossifleur’s pollen.',NULL,'Bee Fly Pokémon'),(743,'ribombee',7,'It makes pollen puffs from pollen and nectar.\nThe puffs’ effects depend on the type of\ningredients and how much of each one is used.',NULL,'Bee Fly Pokémon'),(744,'rockruff',7,'This Pokémon can bond very strongly with its\nTrainer, but it also has a habit of biting. Raising\na Rockruff for a long time can be challenging.',NULL,'Puppy Pokémon'),(745,'lycanroc',7,'This Lycanroc is calm and cautious. The rocks\njutting from its mane are razor sharp.',NULL,'Wolf Pokémon'),(746,'wishiwashi',7,'Individually, they’re incredibly weak. It’s by\ngathering up into schools that they’re able\nto confront opponents.',NULL,'Small Fry Pokémon'),(747,'mareanie',7,'The first symptom of its sting is numbness.\nThe next is an itching sensation so intense that it’s\nimpossible to resist the urge to claw at your skin.',NULL,'Brutal Star Pokémon'),(748,'toxapex',7,'To survive in the cold waters of Galar, this\nPokémon forms a dome with its legs, enclosing\nits body so it can capture its own body heat.',NULL,'Brutal Star Pokémon'),(749,'mudbray',7,'Loads weighing up to 50 times as much as its\nown body weight pose no issue for this Pokémon.\nIt’s skilled at making use of mud.',NULL,'Donkey Pokémon'),(750,'mudsdale',7,'Mud that hardens around a Mudsdale’s legs\nsets harder than stone. It’s so hard that it allows\nthis Pokémon to scrap a truck with a single kick.',NULL,'Draft Horse Pokémon'),(751,'dewpider',7,'It forms a water bubble at the rear of its body\nand then covers its head with it. Meeting another\nDewpider means comparing water-bubble sizes.',NULL,'Water Bubble Pokémon'),(752,'araquanid',7,'It launches water bubbles with its legs, drowning\nprey within the bubbles. This Pokémon can then\ntake its time to savor its meal.',NULL,'Water Bubble Pokémon'),(753,'fomantis',7,'When bathed in sunlight, this Pokémon emits a\npleasantly sweet scent, which causes bug\nPokémon to gather around it.',NULL,'Sickle Grass Pokémon'),(754,'lurantis',7,'This Pokémon resembles a beautiful flower.\nA properly raised Lurantis will have gorgeous,\nbrilliant colors.',NULL,'Bloom Sickle Pokémon'),(755,'morelull',7,'Pokémon living in the forest eat the\ndelicious caps on Morelull’s head.\nThe caps regrow overnight.',NULL,'Illuminating Pokémon'),(756,'shiinotic',7,'Its flickering spores lure in prey and put them to\nsleep. Once this Pokémon has its prey snoozing,\nit drains their vitality with its fingertips.',NULL,'Illuminating Pokémon'),(757,'salandit',7,'Its venom sacs produce a fluid that this\nPokémon then heats up with the flame in its tail.\nThis process creates Salandit’s poisonous gas.',NULL,'Toxic Lizard Pokémon'),(758,'salazzle',7,'Only female Salazzle exist. They emit a gas laden\nwith pheromones to captivate male Salandit.',NULL,'Toxic Lizard Pokémon'),(759,'stufful',7,'Its fluffy fur is a delight to pet, but carelessly\nreaching out to touch this Pokémon could result\nin painful retaliation.',NULL,'Flailing Pokémon'),(760,'bewear',7,'Once it accepts you as a friend, it tries to show\nits affection with a hug. Letting it do that is\ndangerous—it could easily shatter your bones.',NULL,'Strong Arm Pokémon'),(761,'bounsweet',7,'Its body gives off a sweet, fruity scent that is\nextremely appetizing to bird Pokémon.',NULL,'Fruit Pokémon'),(762,'steenee',7,'As it twirls like a dancer, a sweet smell spreads\nout around it. Anyone who inhales the scent will\nfeel a surge of happiness.',NULL,'Fruit Pokémon'),(763,'tsareena',7,'This feared Pokémon has long, slender legs and\na cruel heart. It shows no mercy as it stomps on\nits opponents.',NULL,'Fruit Pokémon'),(764,'comfey',7,'Comfey picks flowers with its vine and decorates\nitself with them. For some reason, flowers won’t\nwither once they’re attached to a Comfey.',NULL,'Posy Picker Pokémon'),(765,'oranguru',7,'With waves of its fan—made from leaves and its\nown fur—Oranguru skillfully gives instructions to\nother Pokémon.',NULL,'Sage Pokémon'),(766,'passimian',7,'Displaying amazing teamwork, they follow the\norders of their boss as they all help out in the\nsearch for their favorite berries.',NULL,'Teamwork Pokémon'),(767,'wimpod',7,'It’s nature’s cleaner—it eats anything and\neverything, including garbage and rotten things.\nThe ground near its nest is always clean.',NULL,'Turn Tail Pokémon'),(768,'golisopod',7,'It will do anything to win, taking advantage of\nevery opening and finishing opponents off with\nthe small claws on its front legs.',NULL,'Hard Scale Pokémon'),(769,'sandygast',7,'Grudges of the dead have possessed a mound of\nsand and become a Pokémon. Sandygast is fond\nof the shovel on its head.',NULL,'Sand Heap Pokémon'),(770,'palossand',7,'Palossand is known as the Beach Nightmare. It\npulls its prey down into the sand by controlling\nthe sand itself, and then it sucks out their souls.',NULL,'Sand Castle Pokémon'),(771,'pyukumuku',7,'It lives in warm, shallow waters. If it encounters a\nfoe, it will spit out its internal organs as a means\nto punch them.',NULL,'Sea Cucumber Pokémon'),(772,'type-null',7,'Rumor has it that the theft of top-secret research\nnotes led to a new instance of this Pokémon\nbeing created in the Galar region.',NULL,'Synthetic Pokémon'),(773,'silvally',7,'A solid bond of trust between this Pokémon and\nits Trainer awakened the strength hidden within\nSilvally. It can change its type at will.',NULL,'Synthetic Pokémon'),(774,'minior',7,'Originally making its home in the ozone layer,\nit hurtles to the ground when the shell enclosing\nits body grows too heavy.',NULL,'Meteor Pokémon'),(775,'komala',7,'It is born asleep, and it dies asleep. All its\nmovements are apparently no more than the\nresults of it tossing and turning in its dreams.',NULL,'Drowsing Pokémon'),(776,'turtonator',7,'Explosive substances coat the shell on its back.\nEnemies that dare attack it will be blown away\nby an immense detonation.',NULL,'Blast Turtle Pokémon'),(777,'togedemaru',7,'With the long hairs on its back, this Pokémon\ntakes in electricity from other electric Pokémon.\nIt stores what it absorbs in an electric sac.',NULL,'Roly-Poly Pokémon'),(778,'mimikyu',7,'It wears a rag fashioned into a Pikachu costume\nin an effort to look less scary. Unfortunately,\nthe costume only makes it creepier.',NULL,'Disguise Pokémon'),(779,'bruxish',7,'When it unleashes its psychic power from the\nprotuberance on its head, the grating sound\nof grinding teeth echoes through the area.',NULL,'Gnash Teeth Pokémon'),(780,'drampa',7,'The mountains it calls home are nearly two miles\nin height. On rare occasions, it descends to play\nwith the children living in the towns below.',NULL,'Placid Pokémon'),(781,'dhelmise',7,'After a piece of seaweed merged with debris\nfrom a sunken ship, it was reborn as this\nghost Pokémon.',NULL,'Sea Creeper Pokémon'),(782,'jangmo-o',7,'They learn to fight by smashing their head scales\ntogether. The dueling strengthens both their skills\nand their spirits.',NULL,'Scaly Pokémon'),(783,'hakamo-o',7,'The scaleless, scarred parts of its body are\nsigns of its strength. It shows them off to\ndefeated opponents.',NULL,'Scaly Pokémon'),(784,'kommo-o',7,'It clatters its tail scales to unnerve opponents.\nThis Pokémon will battle only those who stand\nsteadfast in the face of this display.',NULL,'Scaly Pokémon'),(785,'tapu-koko',7,'This guardian deity of Melemele is brimming with\ncuriosity. It summons thunderclouds and stores\ntheir lightning inside its body.',NULL,'Land Spirit Pokémon'),(786,'tapu-lele',7,'This guardian deity of Akala is guilelessly cruel.\nThe fragrant aroma of flowers is the source of\nits energy.',NULL,'Land Spirit Pokémon'),(787,'tapu-bulu',7,'It pulls large trees up by the roots and swings\nthem around. It causes vegetation to grow,\nand then it absorbs energy from the growth.',NULL,'Land Spirit Pokémon'),(788,'tapu-fini',7,'The dense fog it creates brings the downfall\nand destruction of its confused enemies.\nOcean currents are the source of its energy.',NULL,'Land Spirit Pokémon'),(789,'cosmog',7,'This Pokémon came from another universe.\nIts gaseous body is so light that even a gentle\nbreeze can blow it away.',NULL,'Nebula Pokémon'),(790,'cosmoem',7,'The absorption of starlight fuels this Pokémon’s\ngrowth. The shell that encases it is harder than\nany known material.',NULL,'Protostar Pokémon'),(791,'solgaleo',7,'When light radiates from its body, this Pokémon\ncould almost appear to be the sun. It will dispel\nany darkness and light up the world.',NULL,'Sunne Pokémon'),(792,'lunala',7,'Known as the Beast That Calls the Moon, this\nPokémon lives by taking in any and all light and\nconverting it into its own energy.',NULL,'Moone Pokémon'),(793,'nihilego',7,'One of several mysterious Ultra Beasts. People\non the street report observing those infested\nby it suddenly becoming violent.',NULL,'Parasite Pokémon'),(794,'buzzwole',7,'This Ultra Beast appeared from another world.\nIt shows off its body, but whether that display\nis a boast or a threat remains unclear.',NULL,'Swollen Pokémon'),(795,'pheromosa',7,'One of the dangerous Ultra Beasts, it has been\nspotted running across the land at\nterrific speeds.',NULL,'Lissome Pokémon'),(796,'xurkitree',7,'One of the mysterious life-forms known as Ultra\nBeasts. Astonishing electric shocks emanate\nfrom its entire body, according to witnesses.',NULL,'Glowing Pokémon'),(797,'celesteela',7,'It appeared from the Ultra Wormhole. Witnesses\nobserved it flying across the sky at high speed.',NULL,'Launch Pokémon'),(798,'kartana',7,'This Ultra Beast came from the Ultra Wormhole.\nIt seems not to attack enemies on its own, but\nits sharp body is a dangerous weapon in itself.',NULL,'Drawn Sword Pokémon'),(799,'guzzlord',7,'It has gobbled mountains and swallowed whole\nbuildings, according to reports. It’s one of the\nUltra Beasts.',NULL,'Junkivore Pokémon'),(800,'necrozma',7,'It survives by absorbing light. After a long time\nspent slumbering underground, impurities\naccumulated within it, causing its body to darken.',NULL,'Prism Pokémon'),(801,'magearna',7,'This artificial Pokémon, constructed more than\n500 years ago, can understand human speech\nbut cannot itself speak.',NULL,'Artificial Pokémon'),(802,'marshadow',7,'By slipping into the shadow of a martial arts\nmaster and copying their movements, this\nPokémon learned the ultimate techniques.',NULL,'Gloomdweller Pokémon'),(803,'poipole',7,'This Ultra Beast is well enough liked to be\nchosen as a first partner in its own world.',NULL,'Poison Pin Pokémon'),(804,'naganadel',7,'It stores hundreds of liters of poisonous liquid\ninside its body. It is one of the organisms known\nas UBs.',NULL,'Poison Pin Pokémon'),(805,'stakataka',7,'It appeared from an Ultra Wormhole. Each one\nappears to be made up of many life-forms\nstacked one on top of each other.',NULL,'Rampart Pokémon'),(806,'blacephalon',7,'It slithers toward people. Then, without warning,\nit triggers the explosion of its own head.\nIt’s apparently one kind of Ultra Beast.',NULL,'Fireworks Pokémon'),(807,'zeraora',7,'It runs as fast as lightning strikes, shredding its\nopponents with its high-voltage claws.',NULL,'Thunderclap Pokémon'),(808,'meltan',7,'It dissolves and eats metal. Circulating liquid\nmetal within its body is how it generates energy.',NULL,'Hex Nut Pokémon'),(809,'melmetal',7,'At the end of its life-span, Melmetal will rust and\nfall apart. The small shards left behind will\neventually be reborn as Meltan.',NULL,'Hex Nut Pokémon'),(810,'grookey',8,'When it uses its special stick to strike up a beat,\nthe sound waves produced carry revitalizing\nenergy to the plants and flowers in the area.',NULL,'Chimp Pokémon'),(811,'thwackey',8,'The faster a Thwackey can beat out a rhythm\nwith its two sticks, the more respect it wins from\nits peers.',NULL,'Beat Pokémon'),(812,'rillaboom',8,'By drumming, it taps into the power of its special\ntree stump. The roots of the stump follow its\ndirection in battle.',NULL,'Drummer Pokémon'),(813,'scorbunny',8,'A warm-up of running around gets fire energy\ncoursing through this Pokémon’s body. Once that\nhappens, it’s ready to fight at full power.',NULL,'Rabbit Pokémon'),(814,'raboot',8,'Its thick and fluffy fur protects it from the cold\nand enables it to use hotter fire moves.',NULL,'Rabbit Pokémon'),(815,'cinderace',8,'It juggles a pebble with its feet, turning it into a\nburning soccer ball. Its shots strike opponents\nhard and leave them scorched.',NULL,'Striker Pokémon'),(816,'sobble',8,'When scared, this Pokémon cries. Its tears pack\nthe chemical punch of 100 onions, and attackers\nwon’t be able to resist weeping.',NULL,'Water Lizard Pokémon'),(817,'drizzile',8,'A clever combatant, this Pokémon battles using\nwater balloons created with moisture secreted\nfrom its palms.',NULL,'Water Lizard Pokémon'),(818,'inteleon',8,'It has many hidden capabilities, such as fingertips\nthat can shoot water and a membrane on its back\nthat it can use to glide through the air.',NULL,'Secret Agent Pokémon'),(819,'skwovet',8,'Found throughout the Galar region, this Pokémon\nbecomes uneasy if its cheeks are ever completely\nempty of berries.',NULL,'Cheeky Pokémon'),(820,'greedent',8,'It stashes berries in its tail—so many berries that\nthey fall out constantly. But this Pokémon is a bit\nslow-witted, so it doesn’t notice the loss.',NULL,'Greedy Pokémon'),(821,'rookidee',8,'It will bravely challenge any opponent, no matter\nhow powerful. This Pokémon benefits from every\nbattle—even a defeat increases its strength a bit.',NULL,'Tiny Bird Pokémon'),(822,'corvisquire',8,'Smart enough to use tools in battle, these\nPokémon have been seen picking up rocks and\nflinging them or using ropes to wrap up enemies.',NULL,'Raven Pokémon'),(823,'corviknight',8,'This Pokémon reigns supreme in the skies of the\nGalar region. The black luster of its steel body\ncould drive terror into the heart of any foe.',NULL,'Raven Pokémon'),(824,'blipbug',8,'A constant collector of information, this Pokémon\nis very smart. Very strong is what it isn’t.',NULL,'Larva Pokémon'),(825,'dottler',8,'It barely moves, but it’s still alive. Hiding in its\nshell without food or water seems to have\nawakened its psychic powers.',NULL,'Radome Pokémon'),(826,'orbeetle',8,'It’s famous for its high level of intelligence, and\nthe large size of its brain is proof that it also\npossesses immense psychic power.',NULL,'Seven Spot Pokémon'),(827,'nickit',8,'Aided by the soft pads on its feet, it silently raids\nthe food stores of other Pokémon. It survives off\nits ill-gotten gains.',NULL,'Fox Pokémon'),(828,'thievul',8,'It secretly marks potential targets with a scent.\nBy following the scent, it stalks its targets\nand steals from them when they least expect it.',NULL,'Fox Pokémon'),(829,'gossifleur',8,'It anchors itself in the ground with its single leg,\nthen basks in the sun. After absorbing enough\nsunlight, its petals spread as it blooms brilliantly.',NULL,'Flowering Pokémon'),(830,'eldegoss',8,'The seeds attached to its cotton fluff are full of\nnutrients. It spreads them on the wind so that\nplants and other Pokémon can benefit from them.',NULL,'Cotton Bloom Pokémon'),(831,'wooloo',8,'Its curly fleece is such an effective cushion that\nthis Pokémon could fall off a cliff and stand right\nback up at the bottom, unharmed.',NULL,'Sheep Pokémon'),(832,'dubwool',8,'Weave a carpet from its springy wool, and you end\nup with something closer to a trampoline. You’ll\nstart to bounce the moment you set foot on it.',NULL,'Sheep Pokémon'),(833,'chewtle',8,'Apparently the itch of its teething impels it to\nsnap its jaws at anything in front of it.',NULL,'Snapping Pokémon'),(834,'drednaw',8,'With jaws that can shear through steel rods,\nthis highly aggressive Pokémon chomps down\non its unfortunate prey.',NULL,'Bite Pokémon'),(835,'yamper',8,'This Pokémon is very popular as a herding dog\nin the Galar region. As it runs, it generates\nelectricity from the base of its tail.',NULL,'Puppy Pokémon'),(836,'boltund',8,'This Pokémon generates electricity and channels\nit into its legs to keep them going strong.\nBoltund can run nonstop for three full days.',NULL,'Dog Pokémon'),(837,'rolycoly',8,'Most of its body has the same composition as\ncoal. Fittingly, this Pokémon was first discovered\nin coal mines about 400 years ago.',NULL,'Coal Pokémon'),(838,'carkol',8,'It forms coal inside its body. Coal dropped by\nthis Pokémon once helped fuel the lives of\npeople in the Galar region.',NULL,'Coal Pokémon'),(839,'coalossal',8,'It’s usually peaceful, but the vandalism of mines\nenrages it. Offenders will be incinerated with\nflames that reach 2,700 degrees Fahrenheit.',NULL,'Coal Pokémon'),(840,'applin',8,'It spends its entire life inside an apple. It hides\nfrom its natural enemies, bird Pokémon, by\npretending it’s just an apple and nothing more.',NULL,'Apple Core Pokémon'),(841,'flapple',8,'It ate a sour apple, and that induced its\nevolution. In its cheeks, it stores an acid\ncapable of causing chemical burns.',NULL,'Apple Wing Pokémon'),(842,'appletun',8,'Eating a sweet apple caused its evolution.\nA nectarous scent wafts from its body, luring in\nthe bug Pokémon it preys on.',NULL,'Apple Nectar Pokémon'),(843,'silicobra',8,'As it digs, it swallows sand and stores it in its\nneck pouch. The pouch can hold more than\n17 pounds of sand.',NULL,'Sand Snake Pokémon'),(844,'sandaconda',8,'When it contracts its body, over 220 pounds of\nsand sprays from its nose. If it ever runs out of\nsand, it becomes disheartened.',NULL,'Sand Snake Pokémon'),(845,'cramorant',8,'It’s so strong that it can knock out some\nopponents in a single hit, but it also may\nforget what it’s battling midfight.',NULL,'Gulp Pokémon'),(846,'arrokuda',8,'If it sees any movement around it, this Pokémon\ncharges for it straightaway, leading with its\nsharply pointed jaw. It’s very proud of that jaw.',NULL,'Rush Pokémon'),(847,'barraskewda',8,'This Pokémon has a jaw that’s as sharp as a spear\nand as strong as steel. Apparently Barraskewda’s\nflesh is surprisingly tasty, too.',NULL,'Skewer Pokémon'),(848,'toxel',8,'It stores poison in an internal poison sac and\nsecretes that poison through its skin. If you touch\nthis Pokémon, a tingling sensation follows.',NULL,'Baby Pokémon'),(849,'toxtricity',8,'When this Pokémon sounds as if it’s strumming a\nguitar, it’s actually clawing at the protrusions on\nits chest to generate electricity.',NULL,'Punk Pokémon'),(850,'sizzlipede',8,'It stores flammable gas in its body and uses it to\ngenerate heat. The yellow sections on its belly\nget particularly hot.',NULL,'Radiator Pokémon'),(851,'centiskorch',8,'When it heats up, its body temperature reaches\nabout 1,500 degrees Fahrenheit. It lashes its\nbody like a whip and launches itself at enemies.',NULL,'Radiator Pokémon'),(852,'clobbopus',8,'It’s very curious, but its means of investigating\nthings is to try to punch them with its tentacles.\nThe search for food is what brings it onto land.',NULL,'Tantrum Pokémon'),(853,'grapploct',8,'A body made up of nothing but muscle makes\nthe grappling moves this Pokémon performs with\nits tentacles tremendously powerful.',NULL,'Jujitsu Pokémon'),(854,'sinistea',8,'This Pokémon is said to have been born when\na lonely spirit possessed a cold, leftover cup\nof tea.',NULL,'Black Tea Pokémon'),(855,'polteageist',8,'This species lives in antique teapots.\nMost pots are forgeries, but on rare occasions,\nan authentic work is found.',NULL,'Black Tea Pokémon'),(856,'hatenna',8,'Via the protrusion on its head, it senses other\ncreatures’ emotions. If you don’t have a calm\ndisposition, it will never warm up to you.',NULL,'Calm Pokémon'),(857,'hattrem',8,'No matter who you are, if you bring strong\nemotions near this Pokémon, it will silence\nyou violently.',NULL,'Serene Pokémon'),(858,'hatterene',8,'It emits psychic power strong enough to cause\nheadaches as a deterrent to the approach\nof others.',NULL,'Silent Pokémon'),(859,'impidimp',8,'Through its nose, it sucks in the emanations\nproduced by people and Pokémon when they\nfeel annoyed. It thrives off this negative energy.',NULL,'Wily Pokémon'),(860,'morgrem',8,'When it gets down on all fours as if to beg for\nforgiveness, it’s trying to lure opponents in so\nthat it can stab them with its spear-like hair.',NULL,'Devious Pokémon'),(861,'grimmsnarl',8,'With the hair wrapped around its body helping to\nenhance its muscles, this Pokémon can overwhelm\neven Machamp.',NULL,'Bulk Up Pokémon'),(862,'obstagoon',8,'Its voice is staggering in volume. Obstagoon\nhas a tendency to take on a threatening posture\nand shout—this move is known as Obstruct.',NULL,'Blocking Pokémon'),(863,'perrserker',8,'What appears to be an iron helmet is actually\nhardened hair. This Pokémon lives for the thrill\nof battle.',NULL,'Viking Pokémon'),(864,'cursola',8,'Its shell is overflowing with its heightened\notherworldly energy. The ectoplasm serves as\nprotection for this Pokémon’s core spirit.',NULL,'Coral Pokémon'),(865,'sirfetchd',8,'Only Farfetch’d that have survived many battles\ncan attain this evolution. When this Pokémon’s\nleek withers, it will retire from combat.',NULL,'Wild Duck Pokémon'),(866,'mr-rime',8,'It’s highly skilled at tap-dancing. It waves its cane\nof ice in time with its graceful movements.',NULL,'Comedian Pokémon'),(867,'runerigus',8,'A powerful curse was woven into an ancient\npainting. After absorbing the spirit of a Yamask,\nthe painting began to move.',NULL,'Grudge Pokémon'),(868,'milcery',8,'This Pokémon was born from sweet-smelling\nparticles in the air. Its body is made of cream.',NULL,'Cream Pokémon'),(869,'alcremie',8,'When it trusts a Trainer, it will treat them to\nberries it’s decorated with cream.',NULL,'Cream Pokémon'),(870,'falinks',8,'Five of them are troopers, and one is the brass.\nThe brass’s orders are absolute.',NULL,'Formation Pokémon'),(871,'pincurchin',8,'It feeds on seaweed, using its teeth to scrape it\noff rocks. Electric current flows from the tips of\nits spines.',NULL,'Sea Urchin Pokémon'),(872,'snom',8,'It spits out thread imbued with a frigid sort of\nenergy and uses it to tie its body to branches,\ndisguising itself as an icicle while it sleeps.',NULL,'Worm Pokémon'),(873,'frosmoth',8,'Icy scales fall from its wings like snow as it flies\nover fields and mountains. The temperature of its\nwings is less than −290 degrees Fahrenheit.',NULL,'Frost Moth Pokémon'),(874,'stonjourner',8,'It stands in grasslands, watching the sun’s descent\nfrom zenith to horizon. This Pokémon has a talent\nfor delivering dynamic kicks.',NULL,'Big Rock Pokémon'),(875,'eiscue',8,'It drifted in on the flow of ocean waters from a\nfrigid place. It keeps its head iced constantly to\nmake sure it stays nice and cold.',NULL,'Penguin Pokémon'),(876,'indeedee',8,'It uses the horns on its head to sense the\nemotions of others. Males will act as valets for\nthose they serve, looking after their every need.',NULL,'Emotion Pokémon'),(877,'morpeko',8,'As it eats the seeds stored up in its pocket-like\npouches, this Pokémon is not just satisfying its\nconstant hunger. It’s also generating electricity.',NULL,'Two-Sided Pokémon'),(878,'cufant',8,'It digs up the ground with its trunk. It’s also very\nstrong, being able to carry loads of over\nfive tons without any problem at all.',NULL,'Copperderm Pokémon'),(879,'copperajah',8,'They came over from another region long\nago and worked together with humans.\nTheir green skin is resistant to water.',NULL,'Copperderm Pokémon'),(880,'dracozolt',8,'In ancient times, it was unbeatable thanks to its\npowerful lower body, but it went extinct anyway\nafter it depleted all its plant-based food sources.',NULL,'Fossil Pokémon'),(881,'arctozolt',8,'The shaking of its freezing upper half is what\ngenerates its electricity. It has a hard time\nwalking around.',NULL,'Fossil Pokémon'),(882,'dracovish',8,'Powerful legs and jaws made it the apex predator\nof its time. Its own overhunting of its prey was\nwhat drove it to extinction.',NULL,'Fossil Pokémon'),(883,'arctovish',8,'Though it’s able to capture prey by freezing its\nsurroundings, it has trouble eating the prey\nafterward because its mouth is on top of its head.',NULL,'Fossil Pokémon'),(884,'duraludon',8,'Its body resembles polished metal, and it’s both\nlightweight and strong. The only drawback is that\nit rusts easily.',NULL,'Alloy Pokémon'),(885,'dreepy',8,'After being reborn as a ghost Pokémon,\nDreepy wanders the areas it used to inhabit\nback when it was alive in prehistoric seas.',NULL,'Lingering Pokémon'),(886,'drakloak',8,'It’s capable of flying faster than 120 mph.\nIt battles alongside Dreepy and\ndotes on them until they successfully evolve.',NULL,'Caretaker Pokémon'),(887,'dragapult',8,'When it isn’t battling, it keeps Dreepy in the\nholes on its horns. Once a fight starts, it launches\nthe Dreepy like supersonic missiles.',NULL,'Stealth Pokémon'),(888,'zacian',8,'Known as a legendary hero, this Pokémon\nabsorbs metal particles, transforming them\ninto a weapon it uses to battle.',NULL,'Warrior Pokémon'),(889,'zamazenta',8,'In times past, it worked together with a king of\nthe people to save the Galar region. It absorbs\nmetal that it then uses in battle.',NULL,'Warrior Pokémon'),(890,'eternatus',8,'The core on its chest absorbs energy emanating\nfrom the lands of the Galar region. This energy is\nwhat allows Eternatus to stay active.',NULL,'Gigantic Pokémon'),(891,'kubfu',8,'Kubfu trains hard to perfect its moves. The moves\nit masters will determine which form it takes when\nit evolves.',NULL,'Wushu Pokémon'),(892,'urshifu',8,'This form of Urshifu is a strong believer in the\none-hit KO. Its strategy is to leap in close to foes\nand land a devastating blow with a hardened fist.',NULL,'Wushu Pokémon'),(893,'zarude',8,'Within dense forests, this Pokémon lives in a pack\nwith others of its kind. It’s incredibly aggressive,\nand the other Pokémon of the forest fear it.',NULL,'Rogue Monkey Pokémon'),(894,'regieleki',8,'This Pokémon is a cluster of electrical energy.\nIt’s said that removing the rings on Regieleki’s\nbody will unleash the Pokémon’s latent power.',NULL,'Electron Pokémon'),(895,'regidrago',8,'An academic theory proposes that Regidrago’s\narms were once the head of an ancient dragon\nPokémon. The theory remains unproven.',NULL,'Dragon Orb Pokémon'),(896,'glastrier',8,'Glastrier emits intense cold from its hooves.\nIt’s also a belligerent Pokémon—anything it\nwants, it takes by force.',NULL,'Wild Horse Pokémon'),(897,'spectrier',8,'It probes its surroundings with all its senses save\none—it doesn’t use its sense of sight. Spectrier’s\nkicks are said to separate soul from body.',NULL,'Swift Horse Pokémon'),(898,'calyrex',8,'Calyrex is a merciful Pokémon, capable of\nproviding healing and blessings. It reigned over\nthe Galar region in times of yore.',NULL,'King Pokémon');
